First 5 Forever is an initiative of the Queensland Government, coordinated by State Library of Queensland and delivered in partnership with local government.', 'Library events', 'Free', 'First 5 Forever children''s literacy sessions', NULL, 'Free', 'https://www.trumba.com/i/DgC5cY7OfPMrR2P8njLLWK%2AW.jpg', '2-5 year olds', 'Not required.', NULL, 'Preschool kids', 'Mitchelton Library', 'Mitchelton Library, 37 Heliopolis Parade, Mitchelton', 'Library', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Children''s literacy,Children''s storytime', NULL, NULL, NULL, NULL, NULL, '178445907');
INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, venue, venueaddress, venuetype, maximumparticipantcapacity, activitytype, requirements, meetingpoint, suburb, ward, image, libraryeventtypes, locationifvenueunavailable, eventtype, waterwayaccessfacilities, waterwayaccessinformation, status, externaleventid) VALUES ('Bush Kindy', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d179183337', 'Karawatha Forest Park and Discovery Centre', '2025-02-05T10:00:00+10:00', '2025-02-05T10:45:00+10:00', 'Wednesday, 5 February 2025, 10 - 10:45am', 'Bush Kindy is for children aged 3 - 5 years, alongside their parents and carers. Be immersed in the natural surroundings of the reserve as children build nature confidence through bushwalks, exploration, story-time, art ''n'' craft and much more.

Bush Kindy can go for up to 45 minutes and will go ahead in light rain. Themes vary each week.

On the day of the event:  Please arrive 10 minutes before starting time to check in with staff at the centre. All children must be accompanied and directly supervised by an adult. Please wear a hat, fully enclosed shoes, sun-smart clothing, sunscreen, and bring insect repellent. Please bring water and a snack if required as there are no food outlets on site. It is recommended to bring a spare change of clothes as sessions may include messy play. Note: This event will go ahead in light rain. Events are subject to weather and environmental conditions and may be cancelled on the day.', 'Brisbane City Council', 'Family events,Free,Green', 'Bush Kindy', 'Family events', 'Free', 'https://www.trumba.com/i/DgADEC5pSm9Wizl%2A2XkyE2Un.jpg', 'Ages 3 - 5', 'Bookings required via <a href="https://www.eventbrite.com.au/e/bush-kindy-tickets-1096833521589?aff=oddtdtcreator" target="_blank">Eventbrite</a>.

All adults and children (including infants) must have a ticket for this event. Maximum of 5 people per booking. A ratio of 1 adult per 4 children is required. If you cannot attend this event, cancel your booking via Eventbrite.

As our program is popular, your tickets will be forfeited if you do not arrive in time for the session to make way for available attendees.', TRUE, 'Preschool kids', 'Karawatha Forest Park and Discovery Centre', 'Karawatha Forest Park and Discovery Centre, 149 Acacia Road, Karawatha', 'Park', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '179183337');
INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, venue, venueaddress, venuetype, maximumparticipantcapacity, activitytype, requirements, meetingpoint, suburb, ward, image, libraryeventtypes, locationifvenueunavailable, eventtype, waterwayaccessfacilities, waterwayaccessinformation, status, externaleventid) VALUES ('Free guided tour - Brisbane Botanic Gardens Mt Coot-tha', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d178958008', 'Brisbane Botanic Gardens Mt Coot-tha', '2025-02-05T10:00:00+10:00', '2025-02-05T11:00:00+10:00', 'Wednesday, 5 February 2025, 10 - 11am', 'Take a free volunteer guided walk to learn about the plants and features at Brisbane Botanic Gardens Mt Coot-tha. Our volunteer guides all have a love for Brisbane’s Botanic Gardens and a desire to share their passion and knowledge with visitors.

Walking tours for individuals and small groups (up to ten people) are free and do not require a booking. Have a larger group? Find out more about booking walks for groups 10 or more in size.

Meeting point: Meet at the Mt Coot-tha Visitor Information Centre.

Note: Walks may be subject to environmental conditions and guide capacity on the day.', 'Brisbane City Council', 'Free,Green,Tours', NULL, 'Tours', 'Free', 'https://www.trumba.com/i/DgAUPKxT3P1v35EyxQegZAj5.jpg', 'Suitable for adults', 'No bookings required.', TRUE, 'Young adults,Adults (30+),Seniors', 'Brisbane Botanic Gardens Mt Coot-tha', 'Brisbane Botanic Gardens Mt Coot-tha, 152 Mt Coot-tha Road, Toowong', 'Park', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '178958008');
INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, venue, venueaddress, venuetype, maximumparticipantcapacity, activitytype, requirements, meetingpoint, suburb, ward, image, libraryeventtypes, locationifvenueunavailable, eventtype, waterwayaccessfacilities, waterwayaccessinformation, status, externaleventid) VALUES ('Free guided tour - City Botanic Gardens', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d178957379', 'City Botanic Gardens - Information Kiosk, Brisbane City', '2025-02-05T10:00:00+10:00', '2025-02-05T11:00:00+10:00', 'Wednesday, 5 February 2025, 10 - 11am', 'Take a free volunteer guided walk to learn about the plants and features at the City Botanic Gardens. Our volunteer guides all have a love for Brisbane’s Botanic Gardens and a desire to share their passion and knowledge with visitors.

The walks are taken at a gentle pace for about one hour.

Walking tours for individuals or small groups (no more than ten people) are free and do not require a booking. Have a larger group? Find out more about booking walks for groups 10 or more in size.

Location: Meet at the City Botanic Gardens Information Kiosk (next to the Queensland University of Technology’s Main Drive pathway).

Note: Walks may be subject to environmental conditions and guide capacity on the day.', 'Brisbane City Council', 'Free,Green,Tours', NULL, 'Tours', 'Free', 'https://www.trumba.com/i/DgB7OhUwZOCMvzzoow59j2U7.jpg', 'Suitable for adults', 'For more information call 07 3403 2535.', TRUE, 'Young adults,Adults (30+),Seniors', 'City Botanic Gardens - Information Kiosk, Brisbane City', 'City Botanic Gardens - Information Kiosk, Main Drive, Brisbane City', 'Park', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '178957379');
