INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, venue, venueaddress, venuetype, maximumparticipantcapacity, activitytype, requirements, meetingpoint, suburb, ward, image, libraryeventtypes, locationifvenueunavailable, eventtype, waterwayaccessfacilities, waterwayaccessinformation, status, externaleventid) VALUES ('Gathering - Gaja Kerry Charlton', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d179415553', 'Queen Street Mall, Brisbane City', '2025-02-05T12:00:00+10:00', '2025-02-05T13:00:00+10:00', 'Wednesday, 5 February 2025, 12 - 1pm', 'Gathering presents Gaja Kerry Charlton.

Gaja Kerry Charlton is a Yagarabul Elder and traditional owner in three native title claims – Yuggera Ugarapul Peoples (YUP), Quandamooka, and Kabi Kabi and has Gulf ties. Gaja Kerry grew up Goori way in a culturally saturated lifestyle with traditional Elders, and extended family within a small community. Her career includes teaching, counselling, social justice and reconciliation. Gaja Kerry is currently a Language Fellow at the University of Queensland, part of the Ancient Aboriginal genomic project, Griffith University, and works to repatriate local languages, culture, Country. 

Join us from 12 noon to 1pm at the main stage of Queen Street Mall, to learn some local Yuggera language and place names with Gaja Kerry Charlton.

This Gathering event is produced by Cre8tiveNations.  Gathering showcases Aboriginal and Torres Strait Islander performances in the Queen Street Mall. Unique to Brisbane, it is the only Indigenous performance in Australia that is featured weekly in the heart of a major capital city.', 'Brisbane City Council', 'Aboriginal and Torres Strait Islander,Creative,Culture,Featured,Free,Music,Performing arts', 'Gathering', 'Aboriginal and Torres Strait Islander', 'Free', 'https://www.trumba.com/i/DgDLf7-%2ATMnF1hEAGXeU%2AmUd.jpg', 'Suitable for all ages.', 'No bookings required.', TRUE, NULL, 'Queen Street Mall, Brisbane City', 'Queen Street Mall, Queen Street, Brisbane City', 'General Council venue', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '179415553');
INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, venue, venueaddress, venuetype, maximumparticipantcapacity, activitytype, requirements, meetingpoint, suburb, ward, image, libraryeventtypes, locationifvenueunavailable, eventtype, waterwayaccessfacilities, waterwayaccessinformation, status, externaleventid) VALUES ('Free guided tour - Brisbane Botanic Gardens Mt Coot-tha', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d178958369', 'Brisbane Botanic Gardens Mt Coot-tha', '2025-02-05T12:00:00+10:00', '2025-02-05T13:00:00+10:00', 'Wednesday, 5 February 2025, 12 - 1pm', 'Take a free volunteer guided walk to learn about the plants and features at Brisbane Botanic Gardens Mt Coot-tha. Our volunteer guides all have a love for Brisbane’s Botanic Gardens and a desire to share their passion and knowledge with visitors.

Walking tours for individuals and small groups (up to ten people) are free and do not require a booking. Have a larger group? Find out more about booking walks for groups 10 or more in size.

Meeting point: Meet at the Mt Coot-tha Visitor Information Centre.

Note: Walks may be subject to environmental conditions and guide capacity on the day.', 'Brisbane City Council', 'Free,Green,Tours', NULL, NULL, 'Free', 'https://www.trumba.com/i/DgB5UB5rQjgKE8xMwsGuVN8N.jpg', 'Suitable for adults', 'No bookings required.', TRUE, 'Young adults,Adults (30+),Seniors', 'Brisbane Botanic Gardens Mt Coot-tha', 'Brisbane Botanic Gardens Mt Coot-tha, 152 Mt Coot-tha Road, Toowong', 'Park', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '178958369');
INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, venue, venueaddress, venuetype, maximumparticipantcapacity, activitytype, requirements, meetingpoint, suburb, ward, image, libraryeventtypes, locationifvenueunavailable, eventtype, waterwayaccessfacilities, waterwayaccessinformation, status, externaleventid) VALUES ('Free guided tour - City Botanic Gardens', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d178957687', 'City Botanic Gardens - Information Kiosk, Brisbane City', '2025-02-05T12:00:00+10:00', '2025-02-05T13:00:00+10:00', 'Wednesday, 5 February 2025, 12 - 1pm', 'Take a free volunteer guided walk to learn about the plants and features at the City Botanic Gardens. Our volunteer guides all have a love for Brisbane’s Botanic Gardens and a desire to share their passion and knowledge with visitors.

The walks are taken at a gentle pace for about one hour.

Walking tours for individuals or small groups (no more than ten people) are free and do not require a booking. Have a larger group? Find out more about booking walks for groups 10 or more in size.

Location: Meet at the City Botanic Gardens Information Kiosk (next to the Queensland University of Technology’s Main Drive pathway).

Note: Walks may be subject to environmental conditions and guide capacity on the day.', 'Brisbane City Council', 'Free,Green,Tours', NULL, NULL, 'Free', 'https://www.trumba.com/i/DgCcsVacu0q9GPQRsMK0ZpaW.jpeg', 'Suitable for adults', 'For more information call 07 3403 2535.', TRUE, 'Young adults,Adults (30+),Seniors', 'City Botanic Gardens - Information Kiosk, Brisbane City', 'City Botanic Gardens - Information Kiosk, Main Drive, Brisbane City', 'Park', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '178957687');
INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, venue, venueaddress, venuetype, maximumparticipantcapacity, activitytype, requirements, meetingpoint, suburb, ward, image, libraryeventtypes, locationifvenueunavailable, eventtype, waterwayaccessfacilities, waterwayaccessinformation, status, externaleventid) VALUES ('Community Immunisation Clinic - Toowong', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d178942032', 'Toowong Library', '2025-02-05T12:30:00+10:00', '2025-02-05T14:30:00+10:00', 'Wednesday, 5 February 2025, 12:30 - 2:30pm', 'Brisbane City Council provides free vaccinations to eligible residents (aged from 6 weeks and above) through our community immunisation clinics. Immunisation helps protect people against diseases such as influenza, measles, whooping cough, polio and tetanus.

Take a look at the National Health Medical Research Council vaccination schedule for advice about when you should be vaccinated.

