INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, venue, venueaddress, venuetype, maximumparticipantcapacity, activitytype, requirements, meetingpoint, suburb, ward, image, libraryeventtypes, locationifvenueunavailable, eventtype, waterwayaccessfacilities, waterwayaccessinformation, status, externaleventid) VALUES ('Professional headshots for Brisbane businesses', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d179181227', 'Suburban Business Hub', '2025-02-06T09:00:00+10:00', '2025-02-06T11:30:00+10:00', 'Thursday, 6 February 2025, 9 - 11:30am', '***This event is booked out - join the waitlist*** Start the new year with a fresh look thanks to free professional headshots! 

High-quality headshots evoke professionalism and help put a face to the name of your business. They build trust and demonstrate approachability, helping you attract potential customers.

Brisbane City Council, with LP Commercial Photography & Videography, is providing free headshots to support local businesses to grow and thrive.

It’s the perfect opportunity to help you create a good first impression that sets your business apart from the rest; and better yet, there’s no cost to participate. Timeslot 1: 9–9.30am Timeslot 2: 9.40–10.10am Timeslot 3: 10.20–10.50am Timeslot 4: 11–11.30amLook out for further events in the business series.

*Limited spots available. Tickets available only to businesses located in the Brisbane Local Government Area. Ticketholders will be able to access one image (both colour and black and white). Headshots will be taken against a plain background. Special requests for editing cannot be accommodated.', 'Brisbane City Council', 'Business,Free,Workshops', NULL, 'Business', 'Free', 'https://www.trumba.com/i/DgDHM9MBjH2cCq6OkZip6g6O.jpg', 'Suitable for adults', '*** This event is booked out, however you can join the waitlist by&nbsp;<a href="https://www.eventbrite.com/e/professional-headshots-for-brisbane-businesses-tickets-1089425183049?aff=oddtdtcreator" target="_blank">registering online</a>&nbsp;***', TRUE, 'Young adults,Adults (30+),Seniors', 'Suburban Business Hub', 'Suburban Business Hub, 16 Aspinall Street, Nundah', 'General Council venue', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Booked out', '179181227');
