This is a GOLD event suitable for seniors.', 'Active and healthy events', 'Fitness & well-being', NULL, NULL, 'Pool entry fee', 'https://www.trumba.com/i/DgCyOWPl2xSde9e74Q4VvWn0.jpg', 'Seniors', 'No bookings required. For more information phone Beatriz on 0421 206 217.', NULL, 'Seniors', 'Runcorn Pool, Runcorn', 'Runcorn Pool, 37 Bonemill Road, Runcorn', 'Swimming pool', '.', 'Water activities', 'Swimwear and a towel.', 'Indoor pool group fitness area.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '173999006');
INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, venue, venueaddress, venuetype, maximumparticipantcapacity, activitytype, requirements, meetingpoint, suburb, ward, image, libraryeventtypes, locationifvenueunavailable, eventtype, waterwayaccessfacilities, waterwayaccessinformation, status, externaleventid) VALUES ('Journey to the Stars', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d180400142', 'Sir Thomas Brisbane Planetarium, Mt Coot-tha', '2025-02-06T14:00:00+10:00', '2025-02-06T14:45:00+10:00', 'Thursday, 6 February 2025, 2 - 2:45pm', 'This dazzling space show launches visitors through space and time to experience the life and death of the stars in our night sky, including our own nurturing Sun. Tour familiar stellar formations, explore new celestial mysteries, and discover the fascinating, unfolding story that connects us all to the stars. Those who come along for the journey may never see the night sky in the same way again. Narrated by Whoopi Goldberg, Session concludes with a virtual tour of the Brisbane night sky.

Journey to the Stars was developed by the American Museum of Natural History, New York in collaboration with the California Academy of Sciences, San Francisco; GOTO INC, Tokyo, Japan; Papalote • Museo del Niño, Mexico City, Mexico; and Smithsonian National Air and Space Museum, Washington, D.C. 
Journey to the Stars was created by the American Museum of Natural History, with the major support and partnership of NASA, Science Mission Directorate, Heliophysics Division.', 'Brisbane City Council', 'Family events', NULL, NULL, 'Adult $17, Child (3-14 yrs) $10, Concession $12', 'https://www.trumba.com/i/DgB8v-YDgb8EUUsAZBqd-hZQ.jpg', 'Suitable for ages 8+', '<a href="https://bcc.ungerboeck.com/prod/emc00/register.aspx?aat=716932366e7a4b3130346e7450695571626f344b506873547878464273724e6558464839525656595563413d" target="_blank">CLICK HERE TO BOOK YOUR TICKETS ONLINE</a>

For booking and venue enquiries please phone 07 3403 8888 or email <a href="mailto:bop@brisbane.qld.gov.au" target="_blank">bop@brisbane.qld.gov.au</a>.
To make a Companion Card booking please phone 3403 2578 10am-4pm Tuesday to Sunday.', NULL, NULL, 'Sir Thomas Brisbane Planetarium, Mt Coot-tha', 'Sir Thomas Brisbane Planetarium, 152 Mt Coot-tha Road, Mt Coot-tha', 'General Council venue,Library', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '180400142');
