INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, venue, venueaddress, venuetype, maximumparticipantcapacity, activitytype, requirements, meetingpoint, suburb, ward, image, libraryeventtypes, locationifvenueunavailable, eventtype, waterwayaccessfacilities, waterwayaccessinformation, status, externaleventid) VALUES ('What''s In The Woods? - Backbone Theatre For Babies', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d179547522', 'Seven Hills Hub', '2025-02-06T20:00:00+10:00', '2025-02-06T21:00:00+10:00', 'Thursday, 6 February 2025, 8 - 9pm', 'Be transported to a soft and cosy woodland, right out of a picture book, where each new season is full of natural wonders waiting to be discovered by young, inquisitive minds. Enjoy an engaging and interactive story by the campfire before embarking on your own sensory exploration of the woods. Tailor made for audiences aged 0-3 and filled with performance, puppetry and play ‘What’s In The Woods?’ is a gentle welcome to the world of theatre.

Run Time: Approximately 45 minutes, 20 minutes of performance and 25 minutes of play in the space.

The ''What''s In The Woods?'' sessions are split into 3 age groups running at various times: 0-1 years, 1-2 years and 2-3 years.

Accessibility: Wheelchair accessible, Baby Changing Facilities provided onsite and in space. Pram parking available. Carer resources available. Breakout space available.

Bookings are essential. “Fantastic. Such a safe and welcoming space.” - Audience Review "Incredibly skilled in their craft” - Nothing Ever Happens In Brisbane﻿﻿What''s in the Woods? has been developed as part of the new Backbone Theatre for Babies program, developed with company-in-residence Brymore Productions.

Backbone Theatre for Babies has been assisted by the Australian Government through Creative Australia, it’s arts funding and advisory body.

Backbone is supported by the Queensland Government through Arts Queensland.

Backbone Youth Arts is proudly supported by Brisbane City Council.', 'Brisbane City Council', 'Creative,Culture,Family events,Performing arts', NULL, 'Performing arts', '$15', 'https://www.trumba.com/i/DgAeVusDww6WcfTcBzvZOmp5.jpg', '0-3', 'Bookings are required via Humanitix -&nbsp;<a href="https://events.humanitix.com/what-s-in-the-woods-theatre-for-babies-ages-0-1" target="_blank">Age 0-1</a>,&nbsp;<a href="https://events.humanitix.com/what-s-in-the-woods-theatre-for-babies-ages-1-2-6mxhtlby" target="_blank">Age 1-2</a>,&nbsp;<a href="https://events.humanitix.com/what-s-in-the-woods-theatre-for-babies-ages-2-3-kflrdpbb" target="_blank">Age 2-3</a>', TRUE, 'Infants and toddlers', 'Seven Hills Hub', 'Seven Hills Hub, 28 Tallowwood Street, Seven Hills', 'General Council venue', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '179547522');
