INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, venue, venueaddress, venuetype, maximumparticipantcapacity, activitytype, requirements, meetingpoint, suburb, ward, image, libraryeventtypes, locationifvenueunavailable, eventtype, waterwayaccessfacilities, waterwayaccessinformation, status, externaleventid) VALUES ('Community Immunisation Clinic - Corinda', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d178942132', 'Corinda Bowls Club, 58 Hall Avenue, Corinda', '2025-02-07T09:00:00+10:00', '2025-02-07T11:00:00+10:00', 'Friday, 7 February 2025, 9 - 11am', 'Brisbane City Council provides free vaccinations to eligible residents (aged from 6 weeks and above) through our community immunisation clinics. Immunisation helps protect people against diseases such as influenza, measles, whooping cough, polio and tetanus.

Take a look at the National Health Medical Research Council vaccination schedule for advice about when you should be vaccinated.

roviding a free immunisation service is another way Council is helping deliver our Brisbane Vision.', 'Brisbane City Council', 'Fitness & well-being', NULL, 'Fitness & well-being', NULL, 'https://www.trumba.com/i/DgDlw8PtDv1ooinXdKdqMtAV.jpeg', 'Suitable for all ages', 'Bookings are required to attend a clinic. We are unable to accommodate walk-ins.

<a href="https://www.eventbrite.com.au/e/community-immunisation-clinics-corinda-2025-tickets-1097741868479" target="_blank">Book your appointment via Eventbrite</a><br /><br /><strong>Attending the clinic</strong><ul>	<li>Residents who have made a booking must attend the clinic by no later than 15 minutes prior to the clinic closing time.</li>	<li>If you are unable to attend your appointment, cancel your booking via Eventbrite at your earliest convenience.</li></ul>', TRUE, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '178942132');
