INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, venue, venueaddress, venuetype, maximumparticipantcapacity, activitytype, requirements, meetingpoint, suburb, ward, image, libraryeventtypes, locationifvenueunavailable, eventtype, waterwayaccessfacilities, waterwayaccessinformation, status, externaleventid) VALUES ('Bush Babies', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d178868378', 'Karawatha Forest Park and Discovery Centre', '2025-02-07T10:00:00+10:00', '2025-02-07T12:00:00+10:00', 'Friday, 7 February 2025, 10am - 12pm', 'Bring your babies to Karawatha Forest and immerse them in the wonders of the outdoors. This free-form event introduces your baby to the joy of free play in nature. Bush Babies offers a safe space for families to connect with each other and their local bushland reserve. Join us for a morning of exploration and connection, where parents and children aged 0-1 can play, learn, and make new friends.

Requirements: All babies must be accompanied and directly supervised by an adult. Wear a wide-brimmed hat, sun-smart clothing, sunscreen, fully enclosed walking shoes and insect repellent. Bring drinking water and a snack or picnic lunch as there are no food outlets on site.

Note: Events are subject to weather and environmental conditions and may be cancelled on the day.', 'Brisbane City Council', 'Family events,Free,Green', NULL, 'Family events', 'Free', 'https://www.trumba.com/i/DgCkGPMJD0QPA5FgxbHffdhS.jpg', 'Suitable for ages 0-1 years', 'No bookings required.', TRUE, 'Infants and toddlers', 'Karawatha Forest Park and Discovery Centre', 'Karawatha Forest Park and Discovery Centre, 149 Acacia Road, Karawatha', 'Park', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '178868378');
