This is a GOLD event suitable for seniors.', 'Active and healthy events', 'Fitness & well-being,Free', NULL, NULL, 'Free', 'https://www.trumba.com/i/DgADQShbtc%2AfhuYzSErA50Aa.jpeg', 'Seniors', 'Bookings essential. To book visit <a href="http://bookwhen.com/lizkingfitness" target="_blank">LK Fitness</a>. For more information phone 0405 652 109.', NULL, 'Seniors', 'Acacia Ridge Hall, Acacia Ridge', 'Acacia Ridge Hall, 13 Coley Street, Acacia Ridge', 'Community Hall,General Council venue', '.', 'Fitness and strength', 'Hand weights and an exercise mat.', 'Main entrance of hall.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '174272790');
