The First 5 Forever initiative is funded by the Queensland Government.', 'Library events', 'Creative,Family events,Free', 'First 5 Forever children''s literacy sessions', NULL, 'Free', 'https://www.trumba.com/i/DgDdaot7NJFpABm9pXscEFN-.jpg', '0-5 year olds', 'Not required.', NULL, 'Infants and toddlers,Preschool kids', 'Chermside Library', 'Chermside Library, 375 Hamilton Road, Chermside', 'Library', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Children''s literacy', NULL, NULL, NULL, NULL, NULL, '179612186');
INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, venue, venueaddress, venuetype, maximumparticipantcapacity, activitytype, requirements, meetingpoint, suburb, ward, image, libraryeventtypes, locationifvenueunavailable, eventtype, waterwayaccessfacilities, waterwayaccessinformation, status, externaleventid) VALUES ('A Weekend in Seoul', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d179065541', 'Longwang , 144 Edward St, Brisbane 4000', '2025-02-07T11:00:00+10:00', '2025-02-09T21:00:00+10:00', 'Friday, 7 February, 11am - Sunday, 9 February 2025, 9pm', 'BrisAsia Festival 2025 presents A Weekend in Seoul

Step into the heart of Seoul right here in Brisbane at Longwang, Brisbane’s contemporary Asian bar and dining hotspot.

Longwang invites you to experience ‘A Weekend in Seoul’ as part of BrisAsia Festival 2025. This exclusive culinary journey celebrates Head Chef Andy Choi''s Korean heritage with a special menu that captures the spirit of his hometown through inventive interpretations of Korean flavours.

Explore vibrant dishes crafted with fresh, locally sourced produce and infused with traditional Korean spices, fermented flavours, and modern twists that highlight Brisbane’s multicultural vibe. The chic, urban setting of Longwang, inspired by the mythical Dragon King of the Sea, adds an immersive ambiance to this Seoul-inspired feast.

Join us for this limited-edition dining experience and savour the essence of Korea, brought to life in the heart of Brisbane.

Presented by Longwang.', 'Brisbane City Council', 'Creative,Culture,Featured,Festivals,Food', 'BrisAsia 2025', 'Food', 'Various', 'https://www.trumba.com/i/DgD6inLpXL6KeccczFzGMOxI.jpg', 'Suitable for all ages.', 'Bookings required. To book, visit the <a href="https://www.longwang.com.au/bookings" target="_blank">Longwang website.</a>', TRUE, 'Young adults,Adults (30+)', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '179065541');
