<a href="https://www.eventbrite.com.au/e/community-immunisation-clinics-upper-mt-gravatt-2025-tickets-1097758538339" target="_blank">Book your appointment via Eventbrite</a><br /><br /><strong>Attending the clinic</strong><ul>	<li>Residents who have made a booking must attend the clinic by no later than 15 minutes prior to the clinic closing time.</li>	<li>If you are unable to attend your appointment, cancel your booking via Eventbrite at your earliest convenience.</li></ul>', TRUE, NULL, 'Garden City Library', 'Garden City Library, Westfield Mt Gravatt, Level R4, corner of Logan Road and Kessels Road, Upper Mount Gravatt', 'Library', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '178942375');
