INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, venue, venueaddress, venuetype, maximumparticipantcapacity, activitytype, requirements, meetingpoint, suburb, ward, image, libraryeventtypes, locationifvenueunavailable, eventtype, waterwayaccessfacilities, waterwayaccessinformation, status, externaleventid) VALUES ('Passport to the Universe', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d180400385', 'Sir Thomas Brisbane Planetarium, Mt Coot-tha', '2025-02-07T14:00:00+10:00', '2025-02-07T14:45:00+10:00', 'Friday, 7 February 2025, 2 - 2:45pm', 'Get your passport for a thrilling journey through the Solar System, beneath the rings of Saturn, into the heart of the Orion Nebula, out of the Milky Way Galaxy and to the edge of the observable universe, returning home via a black hole. Narrated by Tom Hanks.

Session concludes with a virtual tour of the Brisbane night sky.

Passport to the Universe was developed by the American Museum of Natural History, New York in collaboration with the National Aeronautics and Space Administration (NASA).
Major support for new version provided by the California Academy of Sciences, San Francisco.', 'Brisbane City Council', 'Family events', NULL, NULL, 'Adult $17, Child (3-14 yrs) $10, Concession $12', 'https://www.trumba.com/i/DgA9wToSBEymI-YpwU-TsRm-.jpg', 'Suitable for ages 8+', '<a href="https://bcc.ungerboeck.com/prod/emc00/register.aspx?aat=68627969447a535244764854326d325456325238697333416c532b4f4475594e643566794f794b463648413d" target="_blank"><strong>CLICK HERE TO BOOK YOUR TICKETS ONLINE</strong></a>

For booking and venue enquiries please phone 07 3403 8888 or email <a href="mailto:bop@brisbane.qld.gov.au" target="_blank">bop@brisbane.qld.gov.au</a>.
To make a Companion Card booking please phone 3403 2578 10am-4pm Tuesday to Sunday.', TRUE, NULL, 'Sir Thomas Brisbane Planetarium, Mt Coot-tha', 'Sir Thomas Brisbane Planetarium, 152 Mt Coot-tha Road, Mt Coot-tha', 'General Council venue,Library', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '180400385');
