Gifts of a Blue Pearl Vol 2 is a visual and audio meditation experience that is beyond language and thoughts that celebrates the magnificent life forces at play on this glorious blue pearl - Earth, and pays homage to Guanyin - the deity of mercy and compassion.  Man&Wah are twin brothers and artistic duo, their creative works are inspired by nature from a cosmic perspective. Using photography, video, audio and physical installations Man&Wah create immersive experiences that invite slowing down, wondering and reflection in the mysteries and beauty of the cosmos.', 'Brisbane City Council', 'Art,Creative,Culture,Featured,Festivals,Music', 'BrisAsia 2025', NULL, 'General Admission $20', 'https://www.trumba.com/i/DgD-Hap3mvSaYxlZP5EGcoeZ.jpg', NULL, 'Book your tickets <a href="https://bcc.ungerboeck.com/prod/emc00/register.aspx?aat=3634485875455a743955616a35723577776937766f39716d554f7638375564476d365268756e4d572b36773d" target="_blank"><strong>online</strong>.</a>', TRUE, NULL, 'Sir Thomas Brisbane Planetarium, Mt Coot-tha', 'Sir Thomas Brisbane Planetarium, 152 Mt Coot-tha Road, Mt Coot-tha', 'General Council venue,Library', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '179613378');
INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, venue, venueaddress, venuetype, maximumparticipantcapacity, activitytype, requirements, meetingpoint, suburb, ward, image, libraryeventtypes, locationifvenueunavailable, eventtype, waterwayaccessfacilities, waterwayaccessinformation, status, externaleventid) VALUES ('BrisAsia Improvised', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d179065488', 'Big Fork Theatre, Level 2, 252 St Pauls Terrace, Fortitude Valley 4000', '2025-02-07T19:30:00+10:00', '2025-02-07T20:30:00+10:00', 'Friday, 7 February 2025, 7:30 - 8:30pm', 'BrisAsia Festival 2025 presents BrisAsia Improvised


Get ready for a madcap fusion of comedy, culture, and language in this improvised show featuring some of Big Fork Theatre''s best multicultural performers. Through true stories of growing up BrisAsian and wild, on-the-spot characters inspired by audience suggestions, this show promises a unique comedic experience where anything can happen. Improvised comedy means no scripts and no safety net – just hilarious scenes, characters and stories created right before your eyes.

"I haven’t been to anything like this before," says Nothing Ever Happens in Brisbane. "It was fun, it was loose, it was cool... I laughed a lot and felt right at home." Don’t miss the chance to meet your new best friends in comedy!

Suitable those aged 15 years and older. The content of this event may contain adult themes and strong language. Those aged under 15 years must be accompanied by a legal guardian.

Presented by Big Fork Theatre.', 'Brisbane City Council', 'Creative,Culture,Featured,Festivals,Performing arts', 'BrisAsia 2025', 'Performing arts', 'GA - $20; Group of 4+ - $16', 'https://www.trumba.com/i/DgBAL1vTsJG%2ALQaCQZHmakOx.jpg', '15 years and over', 'Bookings required. To book, visit <a href="https://www.eventbrite.com.au/e/brisasia-improvised-tickets-1061809243029" target="_blank">Eventbrite.</a>', TRUE, 'Young adults,Adults (30+)', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '179065488');
