Whatever your skill level and motivation, joining your local Habitat Brisbane group is a great way to connect to nature and be active and healthy, all while meeting new people, developing new skills and making a difference to your local environment. With 160 groups across the city there’s bound to be one near you!

Habitat Brisbane volunteers undertake a variety of activities including: managing environmental weeds revegetating with local native plants creating habitat for native wildlife citizen science projects.The Mookin-Bah Bushcare Group meets the second and last Saturday of each month 7-9am in the warmer months, 7.30-9.30am in the cooler months.', 'Brisbane City Council', 'Free,Green', NULL, 'Green', 'Free', 'https://www.trumba.com/i/DgD6ACSmtyiBH0JttgRgyFFX.jpg', 'Suitable for adults', 'Bookings required: For more information, or to join a volunteer working bee, contact volunteer group leader Lyn&nbsp;on 0493 030 596.', TRUE, 'Young adults,Adults (30+),Seniors', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '178867966');
