INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, venue, venueaddress, venuetype, maximumparticipantcapacity, activitytype, requirements, meetingpoint, suburb, ward, image, libraryeventtypes, locationifvenueunavailable, eventtype, waterwayaccessfacilities, waterwayaccessinformation, status, externaleventid) VALUES ('Volunteer Bushcare Working Bee - Perrin Creek & Seven Hills Bushland Rehabilitation Group', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d178573087', 'Seven Hills Bushland Reserve, Seven Hills', '2025-02-08T07:30:00+10:00', '2025-02-08T10:00:00+10:00', 'Saturday, 8 February 2025, 7:30 - 10am', 'Join other like-minded volunteers to help protect and restore Brisbane’s unique biodiversity through our Habitat Brisbane program.

Whatever your skill level and motivation, joining your local Habitat Brisbane group is a great way to connect to nature and be active and healthy, all while meeting new people, developing new skills and making a difference to your local environment. With 160 groups across the city there’s bound to be one near you!

