INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, venue, venueaddress, venuetype, maximumparticipantcapacity, activitytype, requirements, meetingpoint, suburb, ward, image, libraryeventtypes, locationifvenueunavailable, eventtype, waterwayaccessfacilities, waterwayaccessinformation, status, externaleventid) VALUES ('BrisAsia Dance Battles – Day 1 Radikal Forze Jam Australian Qualifiers', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d179053877', 'VENTspace, 23 Glenelg Street, South Brisbane 4101', '2025-02-08T10:00:00+10:00', '2025-02-08T18:00:00+10:00', 'Saturday, 8 February 2025, 10am - 6pm', 'BrisAsia Festival 2025 presents BrisAsia Dance Battles


BrisAsia Dance Battles, Queensland’s largest street dance battle event, is back again on 8 and 9 of February as part of BrisAsia Festival. Up for grabs: Cash prizes, international flights, accommodation and a Wildcard entry into Radikal Forze Jam in Vietnam, Asia’s biggest independent dance festival.

Australia''s finest street dancers will travel to Brisbane and compete across 3 categories, representing styles such as Hip Hop, Popping, House, Breaking, Waacking, Locking, Krump, Dancehall and more. Featuring renowned international guest judge "KrazyBonez" from Taiwan and 2 days of exhilarating competitions and social dance, you won''t want to miss this calendar event showcasing the best in Australian and Asian street dance.

The Day 1 Qualifiers will feature a qualification draw for 3 categories: Hip Hop 1v1, Popping 1v1 and Open Styles 1v1. This is not a day to miss, with over 6 hours of battles to feature.

