INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, venue, venueaddress, venuetype, maximumparticipantcapacity, activitytype, requirements, meetingpoint, suburb, ward, image, libraryeventtypes, locationifvenueunavailable, eventtype, waterwayaccessfacilities, waterwayaccessinformation, status, externaleventid) VALUES ('Meet wildlife neighbours', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d178869008', 'Karawatha Forest Park and Discovery Centre', '2025-02-08T10:00:00+10:00', '2025-02-08T11:00:00+10:00', 'Saturday, 8 February 2025, 10 - 11am', 'Native wildlife live all around us - from our backyards, to local parks and nature reserves. But have you had a chance to meet them up close? Join our wildlife expert as they introduce you to amphibians, reptiles, mammals and birds. Learn more about these unique Australian animals and how you can help your wildlife neighbours.

Requirements: Arrive 10 minutes before starting time to check in. All children must be accompanied and directly supervised by an adult. Wear a wide-brimmed hat, sun-smart clothing and sunscreen as some shows may take place outside. Bring drinking water and a snack or picnic lunch as there are no food outlets on site.

