Live Music, DJs and Cultural Performance.

Get ready to vibe at BEAT STREET, where beats hit harder, art runs wild and creativity knows no bounds. Kick off the day with the SHOKU SOUND LAB, an immersive workshop for emerging DJs, producers, and musicians. Collaborate with industry pros, and bring your music to life in an inspiring setting, supported by Focusrite and Shoku.

As night falls, the energy flows and Warehouse 25 morphs into an all-out BEAT STREET party. Headlining with Sydney-based DJ Aywy the program includes the rising vocal and rap star Siala, intimate sets with the soulful voice of Indian vocalist Parminder Singh, world instrumentalists, DJs Saie and Scalymoth and more.  Visual maestros will transform the venue into a vibrant street art spectacle, a living canvas celebrating the urban pulse of Brisbane.

Supported by Shoku and Focusrite.', 'Brisbane City Council', 'Art,Creative,Culture,Featured,Festivals,Food,Free,Music', 'BrisAsia 2025', 'Festivals', 'Free', 'https://www.trumba.com/i/DgCtB01D1iU-L4wbawP3smON.jpg', '18 years and over', 'Bookings required. To book, visit <a href="https://www.eventbrite.com.au/e/beat-street-tickets-1108790665729?aff=oddtdtcreator" target="_blank">Eventbrite.</a>', TRUE, 'Young adults,Adults (30+)', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '179053638');
