Get ready for Brisbane’s most electrifying night of 2025 with a fresh, exciting program celebrating Asian pop-culture.

Asia Pop Night takes the music off your screens and into the streets.  With its distinctive blend of addictive melodies, choreography and high production, Kpop until you drop with Brisbane’s favourites taking to the stage, bringing you thrilling performances from your favourite groups. There will be breath-taking visuals and powerful moves that are sure to leave you wanting more.

Make sure to grab your lightsticks, practice your fanchants and get ready to bring your craziest dance moves to celebrate this global phenomenon at the Asian Pop Showcase: Hanmaum!

Matinee performance - 4pm
Evening performance - 6.30pm', 'Brisbane City Council', 'Creative,Culture,Family events,Featured,Festivals,Music,Performing arts', 'BrisAsia 2025', 'Performing arts', '$15', 'https://www.trumba.com/i/DgDaPiDU3weneYmGanl7Adna.jpg', 'Suitable for all ages.', 'Bookings required. To book, please visit the <a href="https://www.thomasdixoncentre.com.au/events/asian-pop-showcase-hanmaum/" target="_blank">Thomas Dixon Centre website.</a>', TRUE, 'Teens,Young adults', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '179053634');
