Sunnybank’s Lunar New Year Rooftop Party is a free, family friendly event on the rooftop at Sunnybank Plaza. Featuring Brisbane’s biggest Lunar New Year fireworks display and an exciting line-up of live entertainment, lion and dragon dance performances and activities for the kids, it’s the perfect way to herald in the Year of the Snake. Plus, all your favourite Sunnybank restaurants will be available for dine in or takeaway, with special Lunar New Year menu offerings.

The event will kick off at 5pm with fireworks scheduled for 8pm. For more information, please visit Experience Sunnybank.', 'Brisbane City Council', 'Creative,Culture,Family events,Featured,Festivals,Food,Free,Markets,Music,Performing arts', 'BrisAsia 2025', 'Festivals', 'Free', 'https://www.trumba.com/i/DgAWjOnnVsGOqJtz6kdcThO4.jpg', 'Suitable for all ages.', 'No bookings required.&nbsp;', TRUE, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '179053642');
