Whatever your skill level and motivation, joining your local Habitat Brisbane group is a great way to connect to nature and be active and healthy, all while meeting new people, developing new skills and making a difference to your local environment. With 160 groups across the city there’s bound to be one near you!

Habitat Brisbane volunteers undertake a variety of activities including: managing environmental weeds revegetating with local native plants creating habitat for native wildlife citizen science projects.The Brandon Road Bushcare Group meet on the 2nd Sunday of the month and welcome new volunteers. 7am – 9am in Summer, 7.30am–9.30am during Autumn and Spring, and 8am – 10am in Winter.

