INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, venue, venueaddress, venuetype, maximumparticipantcapacity, activitytype, requirements, meetingpoint, suburb, ward, image, libraryeventtypes, locationifvenueunavailable, eventtype, waterwayaccessfacilities, waterwayaccessinformation, status, externaleventid) VALUES ('Brisbane at War: military locations in Brisbane during WWII', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d179161791', 'Anzac Square, Brisbane City', '2025-02-09T10:30:00+10:00', '2025-02-09T11:30:00+10:00', 'Sunday, 9 February 2025, 10:30 - 11:30am', 'Join Peter Dunn OAM as he discusses the many military locations that existed in Brisbane during WWII.

Peter is the Webmaster of the popular "Australia @ War" web site at www.ozatwar.comopen_in_new which contains everything you would want to know about military activities in Australia during WWII. His research has made him realise that very few authors and historians have covered much detail about events that occurred on the home front during WWII.

Peter has published 7 E-books on WWII in Australia. He was awarded a Medal of the Order of Australia in January 2020 “for service to community history”. Peter is the Secretary of the Aviation Historical Society of Australia (Qld) Inc. which meets monthly at Archerfield Airport.

After the talk, visitors can stay to explore the Memorial Galleries, embarking on an interactive journey from the First World War to today, before taking time to reflect on the remarkable stories of bravery and sacrifice in the tranquil parklands.

Anzac Square Memorial Galleries is located at 285 Ann Street, Brisbane. Entry is through the double brass doors located beneath the Shrine of Remembrance.', 'Brisbane City Council', 'Exhibitions,Free', NULL, 'Exhibitions', 'Free', 'https://www.trumba.com/i/DgAvfAUeInItnIqJ4rZESkEG.jpg', 'Suitable for all ages', 'Bookings required via the <a href="https://www.anzacsquare.qld.gov.au/whats-on/brisbane-war-military-locations-brisbane-during-wwii-0" target="_blank">Anzac Square Memorial Galleries website</a>.', TRUE, 'Young adults,Adults (30+),Seniors', 'Anzac Square, Brisbane City', 'Anzac Square, 228 Adelaide Street, Brisbane City', 'Non-Council venue', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '179161791');
