On vacation at her grandpa’s, a little girl named Mia accidentally discovers a mysterious piece of astronomical machinery. Edmund, Mia’s eccentric uncle, tricks the girl into using the tool’s secret powers to change the world’s seasons. She realizes the consequences of what they are going to do, but Edmund doesn’t want to let the plan go...

Session concludes with a virtual tour of the Brisbane night sky.', 'Brisbane City Council', 'Family events', NULL, NULL, 'Adult $10, Child (3-14 yrs) $10', 'https://www.trumba.com/i/DgC1VUuKtFcwra%2AJVLavlitN.jpg', 'Suitable for ages 5+', '<strong><a href="https://bcc.ungerboeck.com/prod/emc00/register.aspx?aat=7150693847793167336842555a503259574d2f4e616573584453394e6d4e66594f6b3361484d57555946673d" target="_blank">CLICK HERE TO BOOK YOUR TICKETS ONLINE</a>

