INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, venue, venueaddress, venuetype, maximumparticipantcapacity, activitytype, requirements, meetingpoint, suburb, ward, image, libraryeventtypes, locationifvenueunavailable, eventtype, waterwayaccessfacilities, waterwayaccessinformation, status, externaleventid) VALUES ('Cosmic Collisions', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d180400179', 'Sir Thomas Brisbane Planetarium, Mt Coot-tha', '2025-02-09T12:00:00+10:00', '2025-02-09T12:45:00+10:00', 'Sunday, 9 February 2025, 12 - 12:45pm', 'Collisions, both dazzling and destructive, release energy that drives the growth and evolution of the universe and shape our place within it. Produced by the American Museum of Natural History. Narrated by Robert Redford.

