Join the local community at Nundah for an afternoon on the green at the Toombul Cricket Club. Enjoy a lively summer afternoon for the whole family with a drink from the bar, funky live music from the Swingalicious Big Band and lots of activities for kids.', 'Brisbane City Council', 'Creative,Family events,Free,Music', 'Bands in Parks', 'Music', 'Free', 'https://www.trumba.com/i/DgBiQbo%2Ax0BNids-h4jJuJji.jpg', 'Suitable for all ages', 'No bookings required', TRUE, NULL, 'Oxenham Park, Nundah', 'Oxenham Park, 134 Melton Road, Nundah', 'Park', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Postponed', '179267857');
INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, venue, venueaddress, venuetype, maximumparticipantcapacity, activitytype, requirements, meetingpoint, suburb, ward, image, libraryeventtypes, locationifvenueunavailable, eventtype, waterwayaccessfacilities, waterwayaccessinformation, status, externaleventid) VALUES ('Liquid Memory', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d179065511', 'Queensland Multicultural Centre, 102 Main St, Kangaroo Point 4169', '2025-02-09T15:00:00+10:00', '2025-02-09T16:00:00+10:00', 'Sunday, 9 February 2025, 3 - 4pm', 'BrisAsia Festival 2025 presents Liquid Memory


Visual artist Yao Mikami and vocalist Mico Sundari join forces to deliver a spiritual, multidimensional performance combining captivating melodies and evanescent visual art made with liquid light. In ‘Liquid Memory’, the ancient sounds of Japan come to life in a meditative space where sound and visuals unite, slowing down time and encouraging deep reflection.

Inspired by an exploration of materials, techniques and using natural pigments, Yao Mikami’s work focuses on bridging the gap between the ancient and contemporary. Armed with an analogue overhead projector and tray of liquid, Yao has been developing and performing liquid-light art shows for the past five years, pushing her creative boundaries and focusing on sensory-rich processes.

Born into a family of Japanese Shinto lineage, Mico Sundari struggled with illness from early childhood. In her mid-20s, after undergoing seven surgeries, she began seeking holistic ways of healing and discovered the transformative power of voice. For the past 15 years, Mico has been dedicated to the path of Nada Yoga—the Yoga of Sound, studying and practising with esteemed teachers such as Taro Terahara, Gina Sala (Cirque Du Soleil) and Shivam Rath (Crystal Slide/Raga Retreat). Fascinated by the concept of Kotodama (the spirit of words), she uses singing to convey ancient wisdom, and to foster spiritual connection and healing.

Presented by BEMAC.', 'Brisbane City Council', 'Art,Creative,Culture,Featured,Festivals,Music,Performing arts', 'BrisAsia 2025', 'Performing arts', 'GA - $25; Concession - $15; Under 12 - Free', 'https://www.trumba.com/i/DgClZDe1fR35MQjNtXCF0nOG.jpg', 'Suitable for all ages.', 'Bookings required. To book, visit <a href="https://events.humanitix.com/bemac-live-liquid-memory" target="_blank">Humanitix.</a>', TRUE, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '179065511');
