INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, venue, venueaddress, venuetype, maximumparticipantcapacity, activitytype, requirements, meetingpoint, suburb, ward, image, libraryeventtypes, locationifvenueunavailable, eventtype, waterwayaccessfacilities, waterwayaccessinformation, status, externaleventid) VALUES ('Passport to the Universe', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d180400387', 'Sir Thomas Brisbane Planetarium, Mt Coot-tha', '2025-02-09T15:00:00+10:00', '2025-02-09T15:45:00+10:00', 'Sunday, 9 February 2025, 3 - 3:45pm', 'Get your passport for a thrilling journey through the Solar System, beneath the rings of Saturn, into the heart of the Orion Nebula, out of the Milky Way Galaxy and to the edge of the observable universe, returning home via a black hole. Narrated by Tom Hanks.

Session concludes with a virtual tour of the Brisbane night sky.

Passport to the Universe was developed by the American Museum of Natural History, New York in collaboration with the National Aeronautics and Space Administration (NASA).
Major support for new version provided by the California Academy of Sciences, San Francisco.', 'Brisbane City Council', 'Family events', NULL, NULL, 'Adult $17, Child (3-14 yrs) $10, Concession $12', 'https://www.trumba.com/i/DgA9wToSBEymI-YpwU-TsRm-.jpg', 'Suitable for ages 8+', '<a href="https://bcc.ungerboeck.com/prod/emc00/register.aspx?aat=68627969447a535244764854326d325456325238697333416c532b4f4475594e643566794f794b463648413d" target="_blank"><strong>CLICK HERE TO BOOK YOUR TICKETS ONLINE</strong></a>

For booking and venue enquiries please phone 07 3403 8888 or email <a href="mailto:bop@brisbane.qld.gov.au" target="_blank">bop@brisbane.qld.gov.au</a>.
To make a Companion Card booking please phone 3403 2578 10am-4pm Tuesday to Sunday.', TRUE, NULL, 'Sir Thomas Brisbane Planetarium, Mt Coot-tha', 'Sir Thomas Brisbane Planetarium, 152 Mt Coot-tha Road, Mt Coot-tha', 'General Council venue,Library', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '180400387');
INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, venue, venueaddress, venuetype, maximumparticipantcapacity, activitytype, requirements, meetingpoint, suburb, ward, image, libraryeventtypes, locationifvenueunavailable, eventtype, waterwayaccessfacilities, waterwayaccessinformation, status, externaleventid) VALUES ('BrisAsia Dance Battles – Day 2 Radikal Forze Jam Finals', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d179053878', 'VENTspace, 23 Glenelg Street, South Brisbane 4101', '2025-02-09T16:00:00+10:00', '2025-02-09T21:00:00+10:00', 'Sunday, 9 February 2025, 4 - 9pm', 'BrisAsia Festival 2025 presents BrisAsia Dance Battles  
BrisAsia Dance Battles, Queensland’s largest street dance battle event, is back again on 8 and 9 February as part of BrisAsia Festival.

Up for grabs: Cash prizes, international flights, accommodation and a Wildcard entry into Radikal Forze Jam in Vietnam, Asia’s biggest independent dance festival. Australia''s finest street dancers will travel to Brisbane and compete across 3 categories, representing styles such as Hip Hop, Popping, House, Breaking, Waacking, Locking, Krump, Dancehall and more. Featuring renowned international guest judge "KrazyBonez" from Taiwan and 2 days of exhilarating competitions and social dance, you won''t want to miss this calendar event showcasing the best in Australian and Asian street dance.

The Day 2 Finals will see the top dancers from the qualifications return to compete for the ultimate prize. Refreshments and food trucks will be available throughout the weekend.

BrisAsia Dance Battles are presented by the 2nd Degree Crew and supported by Radikal Forze Jam.', 'Brisbane City Council', 'Creative,Culture,Featured,Festivals,Music,Performing arts', 'BrisAsia 2025', 'Creative', 'Day pass - $15; Weekend pass - $25', 'https://www.trumba.com/i/DgA5eleA42L6b2sLY55FtBqH.jpg', 'Suitable for all ages.', 'Bookings required. To book, visit <a href="https://events.humanitix.com/brisasia-dance-battles-2025-or-radikal-forze-jam-australian-qualifier-or-hip-hop-popping-open-styles-1v1" target="_blank">Humanitix.</a>', TRUE, 'Teens,Young adults,Adults (30+)', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '179053878');
