Join me as I celebrate the richness of the imagination and the wonder of the mystical beings that dwell at the fringes of our world.

Where:  Richard Randall Art Studio - Brisbane Botanic Gardens Mt Coot-tha, Toowong

The venue is located in the parking area just outside the botanical gardens. Please note that while parking is available, it can get very busy on weekends.', 'Brisbane City Council', 'Art', NULL, 'Art', 'Free', 'https://www.trumba.com/i/DgDxRtIkOGrKlRYxv6k5zxRo.jpg', NULL, 'Bookings are not required.', TRUE, 'Infants and toddlers,Preschool kids,Kids,Teens,Young adults,Adults (30+),Seniors', 'Richard Randall Art Studio, Toowong', 'Brisbane Botanic Gardens Mt Coot-tha, 152 Mount Coot-tha Road, Toowong', 'Community Hall,General Council venue', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '180348966');
INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, venue, venueaddress, venuetype, maximumparticipantcapacity, activitytype, requirements, meetingpoint, suburb, ward, image, libraryeventtypes, locationifvenueunavailable, eventtype, waterwayaccessfacilities, waterwayaccessinformation, status, externaleventid) VALUES ('Free guided tour - City Botanic Gardens', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d178957383', 'City Botanic Gardens - Information Kiosk, Brisbane City', '2025-02-10T10:00:00+10:00', '2025-02-10T11:00:00+10:00', 'Monday, 10 February 2025, 10 - 11am', 'Take a free volunteer guided walk to learn about the plants and features at the City Botanic Gardens. Our volunteer guides all have a love for Brisbane’s Botanic Gardens and a desire to share their passion and knowledge with visitors.

The walks are taken at a gentle pace for about one hour.

Walking tours for individuals or small groups (no more than ten people) are free and do not require a booking. Have a larger group? Find out more about booking walks for groups 10 or more in size.

Location: Meet at the City Botanic Gardens Information Kiosk (next to the Queensland University of Technology’s Main Drive pathway).

Note: Walks may be subject to environmental conditions and guide capacity on the day.', 'Brisbane City Council', 'Free,Green,Tours', NULL, 'Tours', 'Free', 'https://www.trumba.com/i/DgB7OhUwZOCMvzzoow59j2U7.jpg', 'Suitable for adults', 'For more information call 07 3403 2535.', TRUE, 'Young adults,Adults (30+),Seniors', 'City Botanic Gardens - Information Kiosk, Brisbane City', 'City Botanic Gardens - Information Kiosk, Main Drive, Brisbane City', 'Park', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '178957383');
