INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, venue, venueaddress, venuetype, maximumparticipantcapacity, activitytype, requirements, meetingpoint, suburb, ward, image, libraryeventtypes, locationifvenueunavailable, eventtype, waterwayaccessfacilities, waterwayaccessinformation, status, externaleventid) VALUES ('Volunteer Bushcare Working Bee - McDowall Bushcare Group', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d178068912', 'McDowall Reserve, 1069 Hamilton Road, McDowall', '2025-02-11T08:30:00+10:00', '2025-02-11T11:30:00+10:00', 'Tuesday, 11 February 2025, 8:30 - 11:30am', 'Join other like-minded volunteers to help protect and restore Brisbane’s unique biodiversity through our Habitat Brisbane program.

Whatever your skill level and motivation, joining your local Habitat Brisbane group is a great way to connect to nature and be active and healthy, all while meeting new people, developing new skills and making a difference to your local environment.

With 160 groups across the city there’s bound to be one near you! 

Habitat Brisbane volunteers undertake a variety of activities including: managing environmental weeds revegetating with local native plants creating habitat for native wildlife  citizen science projects.The McDowall Bushcare Group meets weekly on Tuesday''s at 8.30am.', 'Brisbane City Council', 'Free,Green', NULL, 'Green', 'Free', 'https://www.trumba.com/i/DgDvHjuBGrMT21XY2RFFIIRS.jpg', 'Suitable for adults', 'Bookings required. For more information, or to join a volunteer working bee, contact volunteer group leader Lesley Watson on 0447 342 282 or email <a href="mailto:leswat50@gmail.com" target="_blank">leswat50@gmail.com</a>', TRUE, 'Young adults,Adults (30+),Seniors', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '178068912');
