INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, venue, venueaddress, venuetype, maximumparticipantcapacity, activitytype, requirements, meetingpoint, suburb, ward, image, libraryeventtypes, locationifvenueunavailable, eventtype, waterwayaccessfacilities, waterwayaccessinformation, status, externaleventid) VALUES ('The Way of Tea', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d180289392', 'Botanic Gardens Auditorium, Brisbane Botanic Gardens Mt Coot-tha', '2025-02-11T10:00:00+10:00', '2025-02-11T13:30:00+10:00', 'Tuesday, 11 February 2025, 10am - 1:30pm', 'Indulge in the ancient art of chado – the way of tea. The artform of tea making has been long practiced in Japan. So too has the development of the specialist production processes that create the unique flavours of Japanese artisanal teas.

Delight all your senses with the subtle delicacy of Matcha, the mellow tones of Gyokuro, or enjoy the refreshing bitterness of Sencha, the nuttiness of Hoijcha and the hearty grain flavour of Genmaicha. Learn how each tea is made and the proper method to brew your tea of choice.

This workshop supports the Botanic Gardens'' commitment to creating a plant loving community dedicated to putting the plant back into planet.

Note: This workshop is available only to participants 16 years of age or over.

For more information, email BotGardensWorkshops@brisbane.qld.gov.au', 'Brisbane City Council', 'Free,Green,Workshops', NULL, 'Workshops', 'Free', 'https://www.trumba.com/i/DgBWl55v8eiN4WabtJL-2XHM.jpg', 'Suitable for ages 16+', 'Bookings required via <a href="https://www.eventbrite.com/e/1108888247599" target="_blank">Eventbrite</a>.

&nbsp;', TRUE, 'Young adults,Adults (30+),Seniors', 'Botanic Gardens Auditorium, Brisbane Botanic Gardens Mt Coot-tha', 'Botanic Gardens Auditorium, Brisbane Botanic Gardens Mt Coot-tha, 152 Mt Coot-tha Road, Toowong', 'General Council venue,Library,Park', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '180289392');
INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, venue, venueaddress, venuetype, maximumparticipantcapacity, activitytype, requirements, meetingpoint, suburb, ward, image, libraryeventtypes, locationifvenueunavailable, eventtype, waterwayaccessfacilities, waterwayaccessinformation, status, externaleventid) VALUES ('Enchanted Realms – The debut solo art exhibition of Brisbane artist, Nadia Butler', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d180348967', 'Richard Randall Art Studio, Toowong', '2025-02-11T10:00:00+10:00', '2025-02-11T17:00:00+10:00', 'Tuesday, 11 February 2025, 10am - 5pm', 'You are invited to come along and experience my debut solo art exhibition, ‘Enchanted Realms’. 

Join me as I celebrate the richness of the imagination and the wonder of the mystical beings that dwell at the fringes of our world.

Where:  Richard Randall Art Studio - Brisbane Botanic Gardens Mt Coot-tha, Toowong

The venue is located in the parking area just outside the botanical gardens. Please note that while parking is available, it can get very busy on weekends.', 'Brisbane City Council', 'Art', NULL, 'Art', 'Free', 'https://www.trumba.com/i/DgDxRtIkOGrKlRYxv6k5zxRo.jpg', NULL, 'Bookings are not required.', TRUE, 'Infants and toddlers,Preschool kids,Kids,Teens,Young adults,Adults (30+),Seniors', 'Richard Randall Art Studio, Toowong', 'Brisbane Botanic Gardens Mt Coot-tha, 152 Mount Coot-tha Road, Toowong', 'Community Hall,General Council venue', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '180348967');
INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, venue, venueaddress, venuetype, maximumparticipantcapacity, activitytype, requirements, meetingpoint, suburb, ward, image, libraryeventtypes, locationifvenueunavailable, eventtype, waterwayaccessfacilities, waterwayaccessinformation, status, externaleventid) VALUES ('Bush Kindy', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d179183036', 'Downfall Creek Bushland Centre', '2025-02-11T10:00:00+10:00', '2025-02-11T10:45:00+10:00', 'Tuesday, 11 February 2025, 10 - 10:45am', 'Bush Kindy is for children aged 3 - 5 years, alongside their parents and carers. Be immersed in the natural surroundings of the reserve as children build nature confidence through bushwalks, exploration, story-time, art ''n'' craft and much more.

Bush Kindy can go for up to 45 minutes and will go ahead in light rain. Themes vary each week.

On the day of the event: Please arrive 10 minutes before starting time to check in with staff at the centre. All children must be accompanied and directly supervised by an adult. Please wear a hat, fully enclosed shoes, sun-smart clothing, sunscreen, and bring insect repellent. Please bring water and a snack if required as there are no food outlets on site. It is recommended to bring a spare change of clothes as sessions may include messy play.Note: This event will go ahead in light rain. Events are subject to weather and environmental conditions and may be cancelled on the day.', 'Brisbane City Council', 'Family events,Free,Green', 'Bush Kindy', 'Family events', 'Free', 'https://www.trumba.com/i/DgD5bnWTNVbPDyMb3Arkwz5N.jpg', 'Ages 3 - 5', 'Bookings required via <a href="https://www.eventbrite.com.au/e/bush-kindy-tickets-1096842478379" target="_blank">Eventbrite</a>.

All adults and children (including infants) must have a ticket for this event. Maximum of 5 people per booking. A ratio of 1 adult per 4 children is required. If you cannot attend this event, cancel your booking via Eventbrite.

As our program is popular, your tickets will be forfeited if you do not arrive in time for the session to make way for available attendees.', TRUE, 'Preschool kids', 'Downfall Creek Bushland Centre', 'Downfall Creek Bushland Centre, 815 Rode Road, Chermside West', 'Park', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '179183036');
INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, venue, venueaddress, venuetype, maximumparticipantcapacity, activitytype, requirements, meetingpoint, suburb, ward, image, libraryeventtypes, locationifvenueunavailable, eventtype, waterwayaccessfacilities, waterwayaccessinformation, status, externaleventid) VALUES ('Free guided tour - Brisbane Botanic Gardens Mt Coot-tha', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d178958014', 'Brisbane Botanic Gardens Mt Coot-tha', '2025-02-11T10:00:00+10:00', '2025-02-11T11:00:00+10:00', 'Tuesday, 11 February 2025, 10 - 11am', 'Take a free volunteer guided walk to learn about the plants and features at Brisbane Botanic Gardens Mt Coot-tha. Our volunteer guides all have a love for Brisbane’s Botanic Gardens and a desire to share their passion and knowledge with visitors.

Walking tours for individuals and small groups (up to ten people) are free and do not require a booking. Have a larger group? Find out more about booking walks for groups 10 or more in size.

Meeting point: Meet at the Mt Coot-tha Visitor Information Centre.

Note: Walks may be subject to environmental conditions and guide capacity on the day.', 'Brisbane City Council', 'Free,Green,Tours', NULL, 'Tours', 'Free', 'https://www.trumba.com/i/DgAUPKxT3P1v35EyxQegZAj5.jpg', 'Suitable for adults', 'No bookings required.', TRUE, 'Young adults,Adults (30+),Seniors', 'Brisbane Botanic Gardens Mt Coot-tha', 'Brisbane Botanic Gardens Mt Coot-tha, 152 Mt Coot-tha Road, Toowong', 'Park', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '178958014');
