INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, venue, venueaddress, venuetype, maximumparticipantcapacity, activitytype, requirements, meetingpoint, suburb, ward, image, libraryeventtypes, locationifvenueunavailable, eventtype, waterwayaccessfacilities, waterwayaccessinformation, status, externaleventid) VALUES ('Free guided tour - Brisbane Botanic Gardens Mt Coot-tha', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d178958374', 'Brisbane Botanic Gardens Mt Coot-tha', '2025-02-11T12:00:00+10:00', '2025-02-11T13:00:00+10:00', 'Tuesday, 11 February 2025, 12 - 1pm', 'Take a free volunteer guided walk to learn about the plants and features at Brisbane Botanic Gardens Mt Coot-tha. Our volunteer guides all have a love for Brisbane’s Botanic Gardens and a desire to share their passion and knowledge with visitors.

Walking tours for individuals and small groups (up to ten people) are free and do not require a booking. Have a larger group? Find out more about booking walks for groups 10 or more in size.

Meeting point: Meet at the Mt Coot-tha Visitor Information Centre.

Note: Walks may be subject to environmental conditions and guide capacity on the day.', 'Brisbane City Council', 'Free,Green,Tours', NULL, NULL, 'Free', 'https://www.trumba.com/i/DgB5UB5rQjgKE8xMwsGuVN8N.jpg', 'Suitable for adults', 'No bookings required.', TRUE, 'Young adults,Adults (30+),Seniors', 'Brisbane Botanic Gardens Mt Coot-tha', 'Brisbane Botanic Gardens Mt Coot-tha, 152 Mt Coot-tha Road, Toowong', 'Park', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '178958374');
INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, venue, venueaddress, venuetype, maximumparticipantcapacity, activitytype, requirements, meetingpoint, suburb, ward, image, libraryeventtypes, locationifvenueunavailable, eventtype, waterwayaccessfacilities, waterwayaccessinformation, status, externaleventid) VALUES ('Free guided tour - City Botanic Gardens', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d178957692', 'City Botanic Gardens - Information Kiosk, Brisbane City', '2025-02-11T12:00:00+10:00', '2025-02-11T13:00:00+10:00', 'Tuesday, 11 February 2025, 12 - 1pm', 'Take a free volunteer guided walk to learn about the plants and features at the City Botanic Gardens. Our volunteer guides all have a love for Brisbane’s Botanic Gardens and a desire to share their passion and knowledge with visitors.

The walks are taken at a gentle pace for about one hour.

Walking tours for individuals or small groups (no more than ten people) are free and do not require a booking. Have a larger group? Find out more about booking walks for groups 10 or more in size.

Location: Meet at the City Botanic Gardens Information Kiosk (next to the Queensland University of Technology’s Main Drive pathway).

Note: Walks may be subject to environmental conditions and guide capacity on the day.', 'Brisbane City Council', 'Free,Green,Tours', NULL, NULL, 'Free', 'https://www.trumba.com/i/DgCcsVacu0q9GPQRsMK0ZpaW.jpeg', 'Suitable for adults', 'For more information call 07 3403 2535.', TRUE, 'Young adults,Adults (30+),Seniors', 'City Botanic Gardens - Information Kiosk, Brisbane City', 'City Botanic Gardens - Information Kiosk, Main Drive, Brisbane City', 'Park', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '178957692');
INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, venue, venueaddress, venuetype, maximumparticipantcapacity, activitytype, requirements, meetingpoint, suburb, ward, image, libraryeventtypes, locationifvenueunavailable, eventtype, waterwayaccessfacilities, waterwayaccessinformation, status, externaleventid) VALUES ('Lord Mayor''s City Hall Concerts - Hits of the Crooners', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d179015086', 'Brisbane City Hall, Brisbane City', '2025-02-11T12:00:00+10:00', '2025-02-11T13:00:00+10:00', 'Tuesday, 11 February 2025, 12 - 1pm', 'Lord Mayor''s City Hall Concerts presents Hits of the Crooners.

Take a sentimental journey with Chris Lloyds and the Jamie Rigg Band and be serenaded by songs from the Great American Songbook and other Jazz Standards made popular by the great crooners. Chris’ smooth sophisticated vocal style will take you back to an era when life was less complicated and swing was king. Featuring songs made famous by artists such as Frank Sinatra, Tony Bennett, Dean Martin, Bobby Darin, Nat King Cole, Mel Tormé, Bing Crosby, Sammy Davis Jr, Ray Charles, Andy Williams, Jack Jones and Matt Monro.

This Lord Mayor''s City Hall Concerts is produced by Salubrious Productions.', 'Brisbane City Council', 'Creative,Free,Music,Performing arts', 'Lord Mayor''s City Hall Concerts', 'Music', 'Free', 'https://www.trumba.com/i/DgDniy1QVyPDVE4RYH8cUf%2At.jpg', 'Suitable for all ages.', 'No bookings required.', TRUE, NULL, 'Brisbane City Hall, Brisbane City', 'Brisbane City Hall, 64 Adelaide Street, Brisbane City', 'General Council venue,Library,Light up asset', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '179015086');
INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, venue, venueaddress, venuetype, maximumparticipantcapacity, activitytype, requirements, meetingpoint, suburb, ward, image, libraryeventtypes, locationifvenueunavailable, eventtype, waterwayaccessfacilities, waterwayaccessinformation, status, externaleventid) VALUES ('Community Immunisation Clinic - Zillmere', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d178941843', 'Zillmere Hall, Zillmere', '2025-02-11T12:30:00+10:00', '2025-02-11T14:30:00+10:00', 'Tuesday, 11 February 2025, 12:30 - 2:30pm', 'Brisbane City Council provides free vaccinations to eligible residents (aged from 6 weeks and above) through our community immunisation clinics. Immunisation helps protect people against diseases such as influenza, measles, whooping cough, polio and tetanus.

Take a look at the National Health Medical Research Council vaccination schedule for advice about when you should be vaccinated.

Providing a free immunisation service is another way Council is helping deliver our Brisbane Vision.', 'Brisbane City Council', 'Fitness & well-being', NULL, 'Fitness & well-being', NULL, 'https://www.trumba.com/i/DgCspZvPryKxKNEcI7oeDvs%2A.jpg', 'Suitable for all ages', 'Bookings are required to attend a clinic. We are unable to accommodate walk-ins.

<a href="https://www.eventbrite.com.au/e/community-immunisation-clinics-zillmere-2025-tickets-1097663915319" target="_blank">Book your appointment via Eventbrite</a><br /><br /><strong>Attending the clinic</strong><ul>	<li>Residents who have made a booking must attend the clinic by no later than 15 minutes prior to the clinic closing time.</li>	<li>If you are unable to attend your appointment, cancel your booking via Eventbrite at your earliest convenience.</li></ul>', TRUE, NULL, 'Zillmere Hall, Zillmere', 'Zillmere Hall, 52 Murphy Road, Zillmere', 'Community Hall,General Council venue', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '178941843');
