INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, venue, venueaddress, venuetype, maximumparticipantcapacity, activitytype, requirements, meetingpoint, suburb, ward, image, libraryeventtypes, locationifvenueunavailable, eventtype, waterwayaccessfacilities, waterwayaccessinformation, status, externaleventid) VALUES ('Talk to a Planner', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d180078978', 'Brisbane Business Hub', '2025-02-12T09:00:00+10:00', '2025-02-12T12:00:00+10:00', 'Wednesday, 12 February 2025, 9am - 12pm', 'Talk to a Planner sessions help residents, business owners, community groups and industry professionals understand Brisbane City Plan 2014 (City Plan) and how it relates to their building and construction plans.

Talk to a Planner is available all year round, with additional sessions held regularly across the city for your convenience.

During these free sessions you can speak face-to-face with a planning specialist, giving you the opportunity to ask any questions you may have about how City Plan relates to your property.

Council also has a team of dedicated officers who can answer simple questions about your development application over the phone during business hours (9am-4pm, Monday-Friday). To speak to an officer please phone Council on 07 3403 8888 and ask to speak with a Planning Information Officer.', 'Brisbane City Council', 'Free,Workshops', NULL, 'Workshops', 'Free', 'https://www.trumba.com/i/DgDDj7Yfnr2DtZoLUimpd70i.jpeg', 'Open', 'Sessions are by appointment only. Book your 15 minute appointment via <a href="https://www.eventbrite.com.au/e/talk-to-a-planner-business-hub-cbd-12-february-2025-tickets-1210286632899" target="_blank">Eventbrite</a>.&nbsp;', TRUE, NULL, 'Brisbane Business Hub', 'Level 2, Brisbane Business Hub, 155 Queen Street, Brisbane City', 'Non-Council venue', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '180078978');
