INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, venue, venueaddress, venuetype, maximumparticipantcapacity, activitytype, requirements, meetingpoint, suburb, ward, image, libraryeventtypes, locationifvenueunavailable, eventtype, waterwayaccessfacilities, waterwayaccessinformation, status, externaleventid) VALUES ('Enchanted Realms – The debut solo art exhibition of Brisbane artist, Nadia Butler', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d180348968', 'Richard Randall Art Studio, Toowong', '2025-02-12T10:00:00+10:00', '2025-02-12T17:00:00+10:00', 'Wednesday, 12 February 2025, 10am - 5pm', 'You are invited to come along and experience my debut solo art exhibition, ‘Enchanted Realms’. 

Join me as I celebrate the richness of the imagination and the wonder of the mystical beings that dwell at the fringes of our world.

Where:  Richard Randall Art Studio - Brisbane Botanic Gardens Mt Coot-tha, Toowong

The venue is located in the parking area just outside the botanical gardens. Please note that while parking is available, it can get very busy on weekends.', 'Brisbane City Council', 'Art', NULL, 'Art', 'Free', 'https://www.trumba.com/i/DgDxRtIkOGrKlRYxv6k5zxRo.jpg', NULL, 'Bookings are not required.', TRUE, 'Infants and toddlers,Preschool kids,Kids,Teens,Young adults,Adults (30+),Seniors', 'Richard Randall Art Studio, Toowong', 'Brisbane Botanic Gardens Mt Coot-tha, 152 Mount Coot-tha Road, Toowong', 'Community Hall,General Council venue', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '180348968');
