INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, venue, venueaddress, venuetype, maximumparticipantcapacity, activitytype, requirements, meetingpoint, suburb, ward, image, libraryeventtypes, locationifvenueunavailable, eventtype, waterwayaccessfacilities, waterwayaccessinformation, status, externaleventid) VALUES ('Bush Kindy', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d179183339', 'Karawatha Forest Park and Discovery Centre', '2025-02-12T10:00:00+10:00', '2025-02-12T10:45:00+10:00', 'Wednesday, 12 February 2025, 10 - 10:45am', 'Bush Kindy is for children aged 3 - 5 years, alongside their parents and carers. Be immersed in the natural surroundings of the reserve as children build nature confidence through bushwalks, exploration, story-time, art ''n'' craft and much more.

Bush Kindy can go for up to 45 minutes and will go ahead in light rain. Themes vary each week.

Suitable for ages 3 - 5 years.

On the day of the event  Please arrive 10 minutes before starting time to check in with staff at the centre. All children must be accompanied and directly supervised by an adult. Please wear a hat, fully enclosed shoes, sun-smart clothing, sunscreen, and bring insect repellent. Please bring water and a snack if required as there are no food outlets on site. It is recommended to bring a spare change of clothes as sessions may include messy play. Note: This event will go ahead in light rain. Events are subject to weather and environmental conditions and may be cancelled on the day.', 'Brisbane City Council', 'Family events,Free,Green', 'Bush Kindy', 'Family events', 'Free', 'https://www.trumba.com/i/DgAr2tPNw-AoCPH6jITyMIeR.jpg', 'Ages 3 - 5', 'Bookings required via <a href="https://www.eventbrite.com.au/e/bush-kindy-tickets-1097725469429" target="_blank">Eventbrite</a>.<p>All adults and children (including infants) must have a ticket for this event. Maximum of 5 people per booking. A ratio of 1 adult per 4 children is required. If you cannot attend this event, cancel your booking via Eventbrite.

As our program is popular, your tickets will be forfeited if you do not arrive in time for the session to make way for available attendees.</p>', TRUE, 'Preschool kids', 'Karawatha Forest Park and Discovery Centre', 'Karawatha Forest Park and Discovery Centre, 149 Acacia Road, Karawatha', 'Park', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '179183339');
INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, venue, venueaddress, venuetype, maximumparticipantcapacity, activitytype, requirements, meetingpoint, suburb, ward, image, libraryeventtypes, locationifvenueunavailable, eventtype, waterwayaccessfacilities, waterwayaccessinformation, status, externaleventid) VALUES ('Free guided tour - City Botanic Gardens', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d178957385', 'City Botanic Gardens - Information Kiosk, Brisbane City', '2025-02-12T10:00:00+10:00', '2025-02-12T11:00:00+10:00', 'Wednesday, 12 February 2025, 10 - 11am', 'Take a free volunteer guided walk to learn about the plants and features at the City Botanic Gardens. Our volunteer guides all have a love for Brisbane’s Botanic Gardens and a desire to share their passion and knowledge with visitors.

The walks are taken at a gentle pace for about one hour.

Walking tours for individuals or small groups (no more than ten people) are free and do not require a booking. Have a larger group? Find out more about booking walks for groups 10 or more in size.

Location: Meet at the City Botanic Gardens Information Kiosk (next to the Queensland University of Technology’s Main Drive pathway).

Note: Walks may be subject to environmental conditions and guide capacity on the day.', 'Brisbane City Council', 'Free,Green,Tours', NULL, 'Tours', 'Free', 'https://www.trumba.com/i/DgB7OhUwZOCMvzzoow59j2U7.jpg', 'Suitable for adults', 'For more information call 07 3403 2535.', TRUE, 'Young adults,Adults (30+),Seniors', 'City Botanic Gardens - Information Kiosk, Brisbane City', 'City Botanic Gardens - Information Kiosk, Main Drive, Brisbane City', 'Park', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '178957385');
