INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, venue, venueaddress, venuetype, maximumparticipantcapacity, activitytype, requirements, meetingpoint, suburb, ward, image, libraryeventtypes, locationifvenueunavailable, eventtype, waterwayaccessfacilities, waterwayaccessinformation, status, externaleventid) VALUES ('Gathering - Denzel Briscoe', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d179415577', 'Queen Street Mall, Brisbane City', '2025-02-12T12:00:00+10:00', '2025-02-12T13:00:00+10:00', 'Wednesday, 12 February 2025, 12 - 1pm', 'Gathering presents Denzel Briscoe.

Denzel Briscoe, a Kuku-Yalanji man who grew up in the northern tropical region of Queensland and through life’s journeys has found himself currently living in the Gold Coast. 

Come along from 12 noon-1pm at the main stage of Queen Street Mall to see Denzel share artefacts, storytelling and a didgeridoo performance. 


This Gathering event is produced by Cre8tiveNations.  Gathering showcases Aboriginal and Torres Strait Islander performances in the Queen Street Mall. Unique to Brisbane, it is the only Indigenous performance in Australia that is featured weekly in the heart of a major capital city.', 'Brisbane City Council', 'Aboriginal and Torres Strait Islander,Creative,Culture,Featured,Free,Music,Performing arts', 'Gathering', 'Aboriginal and Torres Strait Islander', 'Free', 'https://www.trumba.com/i/DgCije%2AhLn7OMKYFvc1MP0tI.jpg', 'Suitable for all ages.', 'No bookings required.', TRUE, NULL, 'Queen Street Mall, Brisbane City', 'Queen Street Mall, Queen Street, Brisbane City', 'General Council venue', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '179415577');
