INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, venue, venueaddress, venuetype, maximumparticipantcapacity, activitytype, requirements, meetingpoint, suburb, ward, image, libraryeventtypes, locationifvenueunavailable, eventtype, waterwayaccessfacilities, waterwayaccessinformation, status, externaleventid) VALUES ('Cosmic Collisions', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d180400180', 'Sir Thomas Brisbane Planetarium, Mt Coot-tha', '2025-02-12T14:00:00+10:00', '2025-02-12T14:45:00+10:00', 'Wednesday, 12 February 2025, 2 - 2:45pm', 'Collisions, both dazzling and destructive, release energy that drives the growth and evolution of the universe and shape our place within it. Produced by the American Museum of Natural History. Narrated by Robert Redford.

Session concludes with a virtual tour of the Brisbane night sky.

Cosmic Collisions was developed by the American Museum of Natural History, New York in collaboration with the Denver Museum of Nature & Science; GOTO INC, Tokyo, Japan; and the Shanghai Science & Technology Museum.
Cosmic Collisions was created by the American Museum of Natural History with the major support and partnership of NASA, Science Mission Directorate, Heliophysics Division.', 'Brisbane City Council', 'Family events', NULL, NULL, 'Adult $17, Child (3-14 yrs) $10, Concession $12', 'https://www.trumba.com/i/DgDL9DqgqrsviMRiDyucnjQM.jpg', 'Suitable for ages 8+', '<a href="https://bcc.ungerboeck.com/prod/emc00/register.aspx?aat=4744723872492b43416746756d4d3647682b35384867415a4547754e5933364b54723570626276635737773d" target="_blank"><strong>CLICK HERE TO BOOK YOUR TICKETS ONLINE</strong></a>

For booking and venue enquiries please phone 07 3403 8888 or email <a href="mailto:bop@brisbane.qld.gov.au" target="_blank">bop@brisbane.qld.gov.au</a>.
To make a Companion Card booking please phone 3403 2578 10am-4pm Tuesday to Sunday.', TRUE, NULL, 'Sir Thomas Brisbane Planetarium, Mt Coot-tha', 'Sir Thomas Brisbane Planetarium, 152 Mt Coot-tha Road, Mt Coot-tha', 'General Council venue,Library', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '180400180');
