This is a GOLD event suitable for seniors.', 'Active and healthy events', 'Fitness & well-being,Free', NULL, NULL, 'Free', 'https://www.trumba.com/i/DgB9dSBHJcBHl4TiiLsgG2a8.jpeg', 'Seniors', 'Bookings essential. To book visit <a href="http://picktime.com/ZumbaJessie" target="_blank">Zumba with Jessie</a>. For more information phone Jessie on 0414 348 111.', NULL, 'Seniors', 'Forest Lake Community Hall, Forest Lake', 'Forest Lake Community Hall, 60 College Avenue, Forest Lake', 'Community Hall,General Council venue', '.', 'Fitness and strength', NULL, 'Outside the hall.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '174167394');
INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, venue, venueaddress, venuetype, maximumparticipantcapacity, activitytype, requirements, meetingpoint, suburb, ward, image, libraryeventtypes, locationifvenueunavailable, eventtype, waterwayaccessfacilities, waterwayaccessinformation, status, externaleventid) VALUES ('Free guided tour - Brisbane Botanic Gardens Mt Coot-tha', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d178958376', 'Brisbane Botanic Gardens Mt Coot-tha', '2025-02-13T12:00:00+10:00', '2025-02-13T13:00:00+10:00', 'Thursday, 13 February 2025, 12 - 1pm', 'Take a free volunteer guided walk to learn about the plants and features at Brisbane Botanic Gardens Mt Coot-tha. Our volunteer guides all have a love for Brisbane’s Botanic Gardens and a desire to share their passion and knowledge with visitors.

Walking tours for individuals and small groups (up to ten people) are free and do not require a booking. Have a larger group? Find out more about booking walks for groups 10 or more in size.

Meeting point: Meet at the Mt Coot-tha Visitor Information Centre.

Note: Walks may be subject to environmental conditions and guide capacity on the day.', 'Brisbane City Council', 'Free,Green,Tours', NULL, NULL, 'Free', 'https://www.trumba.com/i/DgB5UB5rQjgKE8xMwsGuVN8N.jpg', 'Suitable for adults', 'No bookings required.', TRUE, 'Young adults,Adults (30+),Seniors', 'Brisbane Botanic Gardens Mt Coot-tha', 'Brisbane Botanic Gardens Mt Coot-tha, 152 Mt Coot-tha Road, Toowong', 'Park', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '178958376');
INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, venue, venueaddress, venuetype, maximumparticipantcapacity, activitytype, requirements, meetingpoint, suburb, ward, image, libraryeventtypes, locationifvenueunavailable, eventtype, waterwayaccessfacilities, waterwayaccessinformation, status, externaleventid) VALUES ('Free guided tour - City Botanic Gardens', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d178957694', 'City Botanic Gardens - Information Kiosk, Brisbane City', '2025-02-13T12:00:00+10:00', '2025-02-13T13:00:00+10:00', 'Thursday, 13 February 2025, 12 - 1pm', 'Take a free volunteer guided walk to learn about the plants and features at the City Botanic Gardens. Our volunteer guides all have a love for Brisbane’s Botanic Gardens and a desire to share their passion and knowledge with visitors.

The walks are taken at a gentle pace for about one hour.

Walking tours for individuals or small groups (no more than ten people) are free and do not require a booking. Have a larger group? Find out more about booking walks for groups 10 or more in size.

Location: Meet at the City Botanic Gardens Information Kiosk (next to the Queensland University of Technology’s Main Drive pathway).

Note: Walks may be subject to environmental conditions and guide capacity on the day.', 'Brisbane City Council', 'Free,Green,Tours', NULL, NULL, 'Free', 'https://www.trumba.com/i/DgCcsVacu0q9GPQRsMK0ZpaW.jpeg', 'Suitable for adults', 'For more information call 07 3403 2535.', TRUE, 'Young adults,Adults (30+),Seniors', 'City Botanic Gardens - Information Kiosk, Brisbane City', 'City Botanic Gardens - Information Kiosk, Main Drive, Brisbane City', 'Park', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '178957694');
INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, venue, venueaddress, venuetype, maximumparticipantcapacity, activitytype, requirements, meetingpoint, suburb, ward, image, libraryeventtypes, locationifvenueunavailable, eventtype, waterwayaccessfacilities, waterwayaccessinformation, status, externaleventid) VALUES ('Community Immunisation Clinic - Sunnybank Hills', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d178942081', 'Sunnybank Hills Library', '2025-02-13T12:15:00+10:00', '2025-02-13T14:15:00+10:00', 'Thursday, 13 February 2025, 12:15 - 2:15pm', 'Brisbane City Council provides free vaccinations to eligible residents (aged from 6 weeks and above) through our community immunisation clinics. Immunisation helps protect people against diseases such as influenza, measles, whooping cough, polio and tetanus.

Take a look at the National Health Medical Research Council vaccination schedule for advice about when you should be vaccinated.

