<a href="https://www.eventbrite.com.au/e/community-immunisation-clinics-carindale-evening-2025-tickets-1097724516579" target="_blank">Book your appointment via Eventbrite</a><br /><br /><strong>Attending the clinic</strong><ul>	<li>Residents who have made a booking must attend the clinic by no later than 15 minutes prior to the clinic closing time.</li>	<li>If you are unable to attend your appointment, cancel your booking via Eventbrite at your earliest convenience.</li></ul>', TRUE, NULL, 'Carindale Library', 'Carindale Library, Westfield Carindale, 1151 Creek Road (near Millennium Boulevard), Carindale', 'Library', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '178942093');
