This initiative is proudly funded and supported by the Queensland Government and the State Library of Queensland.', 'Library events', 'Free,Workshops', 'Library Lovers'' Day', NULL, 'Free', 'https://www.trumba.com/i/DgDivZfLyzyD7EKmgliSryS-.jpg', 'Young adults, Adults (30+), Seniors', 'Bookings required. Phone Coopers Plains Library on 07 3403 1530 to reserve your place.', NULL, 'Young adults,Adults (30+),Seniors', 'Coopers Plains Library', 'Coopers Plains Library, 107 Orange Grove Road, Coopers Plains', 'Library', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Internet classes,Technology classes', NULL, NULL, NULL, NULL, NULL, '179612594');
