Habitat Brisbane volunteers undertake a variety of activities including: Managing environmental weeds revegetating with local native plants creating habitat for native wildlife citizen science projectsStellar Carrington Habitat Group meet the 3rd Saturday of the month 8am - 10am. (Excluding Christmas & Easter) at Ian Page Park, 1A Celestrial Court, Carina', 'Brisbane City Council', 'Free,Green', NULL, 'Green', 'Free', 'https://www.trumba.com/i/DgBSR9qq12GwY7DyxUQwVPS3.jpg', 'Suitable for adults', 'Bookings required. For more information, or to join a volunteer working bee, contact volunteer group leader Rita via text 0407 110 459 or email&nbsp;<a href="http://crb_ford@hotmail.com " target="_blank">crb_ford@hotmail.com&nbsp;</a>', TRUE, 'Young adults,Adults (30+),Seniors', 'Ian Page Park, Carina', 'Ian Page Park, 1A Celestial Court, Carina', 'Park', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '178735883');
