INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, venue, venueaddress, venuetype, maximumparticipantcapacity, activitytype, requirements, meetingpoint, suburb, ward, image, libraryeventtypes, locationifvenueunavailable, eventtype, waterwayaccessfacilities, waterwayaccessinformation, status, externaleventid) VALUES ('Auslan interpreted Brisbane City Hall Tour', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d177815695', 'Museum of Brisbane, Brisbane City', '2025-02-15T10:30:00+10:00', '2025-02-15T11:15:00+10:00', 'Saturday, 15 February 2025, 10:30 - 11:15am', 'Discover the secrets of Brisbane’s heritage-listed City Hall building with an Auslan interpreted tour.

With its impressive neo-classical façade, mosaic tiles, stained-glass windows and soaring ceilings, Brisbane’s heritage-listed City Hall is at the heart of our city. Discover the secrets of this magnificent building which has been the setting for many cultural, social and civic events in our city’s history.

Known as the ‘People’s Place’, City Hall was built between 1920 and 1930 at a cost of almost one million pounds. At the time it was the second largest construction project in Australia, second only to the Sydney Harbour Bridge. A highlight is the stunning auditorium, inspired by Rome’s Pantheon, which has hosted rock stars and royalty and is home to the Father Henry Willis & Sons Pipe Organ, made up of nearly 4,400 pipes. This instrument is one of only two of its kind in the world, and the auditorium continues to be integral to events that reflect our creative and connected city.

City Hall is a working civic building and some areas may be unavailable at certain times.

Tour begins in the King George Square foyer on the ground floor of City Hall.

Duration of tour: 45mins
Capacity: 20 people
Language: Auslan and English
Difficulty: This tour is suitable for all fitness levels and abilities. Please note this tour will include staircases.

Museum of Brisbane is Brisbane City Council’s leading history and art museum where you can experience our city’s vibrant culture.', 'Brisbane City Council', 'Creative,Featured,Free,Tours', NULL, 'Tours', 'Free', 'https://www.trumba.com/i/DgCK4jrB5FCzFMHpx0ySrp46.jpg', 'All ages', 'Bookings required. To book, visit the <a href="https://www.museumofbrisbane.com.au/whats-on/auslan-interpreted-brisbane-city-hall-tour/" target="_blank">MoB website.</a>', TRUE, NULL, 'Museum of Brisbane, Brisbane City', 'Museum of Brisbane, Brisbane City Hall, 64 Adelaide Street, Brisbane City', 'General Council venue', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '177815695');
