INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, venue, venueaddress, venuetype, maximumparticipantcapacity, activitytype, requirements, meetingpoint, suburb, ward, image, libraryeventtypes, locationifvenueunavailable, eventtype, waterwayaccessfacilities, waterwayaccessinformation, status, externaleventid) VALUES ('Botanicals: A language of love - Special walk at Brisbane Botanic Gardens', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d179717259', 'Brisbane Botanic Gardens Mt Coot-tha', '2025-02-15T11:00:00+10:00', '2025-02-15T12:00:00+10:00', 'Saturday, 15 February 2025, 11am - 12pm', 'Bring your special someone and discover the romance of plants at Brisbane Botanic Gardens Mt Coot-tha on Valentine''s Day. From the giving of chocolates and perfumes as gifts to floriography, the complex formal language of flowers, botanicals hold profound emotional symbolism.

The guided walk will be led by the Volunteer Guides of the Brisbane Botanic Gardens Mt Coot-tha.

Requirements: This walk requires average physical activity, including walking distances up to 500m, possibly some uneven ground but mainly paved paths. Stops are short and mainly for guide explanations. Some short standing periods or sitting if required. Please wear a hat, enclosed walking shoes, and be sure to bring a water bottle and sunscreen.

