INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, venue, venueaddress, venuetype, maximumparticipantcapacity, activitytype, requirements, meetingpoint, suburb, ward, image, libraryeventtypes, locationifvenueunavailable, eventtype, waterwayaccessfacilities, waterwayaccessinformation, status, externaleventid) VALUES ('Volunteer Bushcare Working Bee - Arnwood Place Bushcare Group', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d179123313', 'Arnwood Street Park, Annerley', '2025-02-15T15:00:00+10:00', '2025-02-15T17:00:00+10:00', 'Saturday, 15 February 2025, 3 - 5pm', 'Join other like-minded volunteers to help protect and restore Brisbane’s unique biodiversity through our Habitat Brisbane program.

Whatever your skill level and motivation, joining your local Habitat Brisbane group is a great way to connect to nature and be active and healthy, all while meeting new people, developing new skills and making a difference to your local environment. With 160 groups across the city there’s bound to be one near you!

Habitat Brisbane volunteers undertake a variety of activities including: managing environmental weeds revegetating with local native plants creating habitat for native wildlife citizen science projects.The Arnwood Place Bushcare Group meet on the third Saturday of the month and welcomes new volunteers. Starting 2pm in winter and 3pm in summer (excluding April when the group will meet on 12 April 2025).

Venue: Arnwood Street Park, 21 Arnwood Place, Annerley', 'Brisbane City Council', 'Fitness & well-being,Free,Green', NULL, NULL, 'Free', 'https://www.trumba.com/i/DgCd2u5S3dU25Il9zeSxtvig.jpg', 'Suitable for all ages', 'Bookings required. For more information, or to join a volunteer working bee, contact volunteer group leader Stephanie Ford&nbsp;<a href="mailto:s3129636@optusnet.com.au" target="_blank">s3129636@optusnet.com.au</a>.', TRUE, 'Teens,Young adults,Adults (30+),Seniors', 'Arnwood Street Park, Annerley', 'Arnwood Street Park, 21 Arnwood Place, Annerley', 'Park', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '179123313');
