For booking and venue enquiries please phone 07 3403 8888 or email <a href="mailto:bop@brisbane.qld.gov.au" target="_blank">bop@brisbane.qld.gov.au</a>.
To make a Companion Card booking please phone 3403 2578 10am-4pm Tuesday to Sunday.', TRUE, NULL, 'Sir Thomas Brisbane Planetarium, Mt Coot-tha', 'Sir Thomas Brisbane Planetarium, 152 Mt Coot-tha Road, Mt Coot-tha', 'General Council venue,Library', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '180400393');
