INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, venue, venueaddress, venuetype, maximumparticipantcapacity, activitytype, requirements, meetingpoint, suburb, ward, image, libraryeventtypes, locationifvenueunavailable, eventtype, waterwayaccessfacilities, waterwayaccessinformation, status, externaleventid) VALUES ('''Asia Pacific Triennial Kids: Outdoors'' guided walking tour', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d179818460', 'Queen Street Mall, Brisbane City', '2025-02-16T09:30:00+10:00', '2025-02-16T10:15:00+10:00', 'Sunday, 16 February 2025, 9:30 - 10:15am', 'Join us for a family-friendly walking tour of Asia Pacific Triennial Kids: Outdoors.

This exhibition highlights the work of Asia Pacific Triennial Kids artists via lightboxes, banners and projections throughout Brisbane city.

As you explore the city’s streets and laneways your guide will share stories about selected artworks, featuring imaginary creatures and worlds, bright colours, and patterns.

At the end of the tour, you can keep exploring with an exhibition map and sticker sheet.
This project is a collaboration between Brisbane City Council and the Queensland Art Gallery | Gallery of Modern Art (QAGOMA).

Important information Children must be accompanied by an adult parent or guardian to participate Tours run for approximately 45 minutes Content is repeated at each tour Please meet your tour guide outside the Brisbane Visitor Information Centre (previously Regent Theatre), 167 Queen Street Mall, Brisbane', 'Brisbane City Council', 'Art,Creative,Culture,Exhibitions,Free,Tours', 'Outdoor Gallery', 'Art', 'Free', 'https://www.trumba.com/i/DgAlxHpErfEsVWVtDcCzjfcq.jpg', 'All ages.', 'Bookings required. To book tickets, go to <a href="https://www.eventbrite.com.au/e/asia-pacific-triennial-kids-outdoors-guided-walking-tour-tickets-1110981117429" target="_blank">Eventbrite website</a>.', TRUE, NULL, 'Queen Street Mall, Brisbane City', 'Queen Street Mall, Queen Street, Brisbane City', 'General Council venue', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '179818460');
INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, venue, venueaddress, venuetype, maximumparticipantcapacity, activitytype, requirements, meetingpoint, suburb, ward, image, libraryeventtypes, locationifvenueunavailable, eventtype, waterwayaccessfacilities, waterwayaccessinformation, status, externaleventid) VALUES ('Dragonboating', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d174572972', 'Yowoggera Park, Albion', '2025-02-16T09:30:00+10:00', '2025-02-16T11:30:00+10:00', 'Sunday, 16 February 2025, 9:30 - 11:30am', 'Bookings essential. Have fun learning how to paddle in a 12m dragon boat and see the city from a different perspective. Paddle out of Breakfast Creek and onto the Brisbane river. Session includes a warm-up, paddling instruction and time on the water. No children under 12 years of age permitted. Please arrive 30 minutes prior to your confirmed session.', 'Active and healthy events', 'Fitness & well-being,Free', NULL, NULL, 'Free', 'https://www.trumba.com/i/DgBQIuJIZmQJ3FKlnp-dwP9A.jpg', '12 years and over', 'Bookings essential. To book, please visit <a href="http://www.tewakadragons.org/events/" target="_blank">Te Waka Dragons</a> and click on the participant registration link to register.&nbsp; Bookings close 12 noon on the Friday prior to the event.&nbsp;For more information phone 0407 659 237.', NULL, 'Teens,Young adults,Adults (30+)', 'Yowoggera Park, Albion', 'Yowoggera Park, 70 Sandgate Road, Albion', 'Park', '.', 'Adventure,Water activities', 'Clothing and footwear that can get wet (no jeans, heels or boots). Towel and change of clothes. Strongly recommend no valuables or mobile phones are taken on the boat.', 'By the undercover picnic shelter.', 'Albion', 'Hamilton Ward', NULL, NULL, NULL, NULL, 'Single boat ramp', 'Breakfast Creek boat ramp |&nbsp;Status: open', NULL, '174572972');
INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, venue, venueaddress, venuetype, maximumparticipantcapacity, activitytype, requirements, meetingpoint, suburb, ward, image, libraryeventtypes, locationifvenueunavailable, eventtype, waterwayaccessfacilities, waterwayaccessinformation, status, externaleventid) VALUES ('Runcorn Family Fun Day', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d179702361', 'Williams Park, Runcorn', '2025-02-16T10:00:00+10:00', '2025-02-16T14:00:00+10:00', 'Sunday, 16 February 2025, 10am - 2pm', 'Bring the whole family along for a fantastic free day out!

Relax with a free coffee and while the kids can be kept busy with lots of free activities.

See a show by Gecko''s Wildlife, Kids in the Kitchen Interactive, make native clay critters with Bazil Grumble, BCC Pop Up Library, BCC Waste and Litter Activities, BCC City Resilience, SES, Sunnybank Scouts, Sunnybank Girl Guides, Queensland Police Display or one of the other fun displays.

Enjoy a sausage sizzle lunch with all proceeds going to the Sunnybank Hills Rotary Club. Also you can purchase ice-cream from Aaravices mobile food van.

Kids can also enjoy free mini golf, laser tag, rock climbing and bungee wall, face painting, games and activities, fair floss and snow cones.

This event is proudly supported by Brisbane City Council.', 'Brisbane City Council', 'Creative,Family events,Featured,Festivals,Food,Free', NULL, 'Family events', 'Free', 'https://www.trumba.com/i/DgAxuo9FwB6ho4M9Gi0QJMYU.jpg', 'Suitable for all ages', 'No bookings required.', TRUE, NULL, 'Williams Park, Runcorn', 'Williams Park, 79 Ervatamia Street, Runcorn', 'Park', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '179702361');
