INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, venue, venueaddress, venuetype, maximumparticipantcapacity, activitytype, requirements, meetingpoint, suburb, ward, image, libraryeventtypes, locationifvenueunavailable, eventtype, waterwayaccessfacilities, waterwayaccessinformation, status, externaleventid) VALUES ('English conversation group', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d179778702', 'Brisbane Square Library', '2025-02-16T13:30:00+10:00', '2025-02-16T14:30:00+10:00', 'Sunday, 16 February 2025, 1:30 - 2:30pm', 'This friendly and informal group meets in the library every Tuesday, Thursday, Friday and Sunday. Come along to make new friends and improve your English. Learners of all levels are welcome.', 'Library events', 'Free', NULL, NULL, 'Free', 'https://www.trumba.com/i/DgAzjFg6bgY1q4UVLn-4dyK6.jpg', 'Young adults, Adults (30+), Seniors', 'Not required.', NULL, 'Young adults,Adults (30+),Seniors', 'Brisbane Square Library', 'Brisbane Square Library, 266 George Street, Brisbane City', 'Library', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'English conversation groups', NULL, NULL, NULL, NULL, NULL, '179778702');
INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, venue, venueaddress, venuetype, maximumparticipantcapacity, activitytype, requirements, meetingpoint, suburb, ward, image, libraryeventtypes, locationifvenueunavailable, eventtype, waterwayaccessfacilities, waterwayaccessinformation, status, externaleventid) VALUES ('Journey to the Stars', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d180400147', 'Sir Thomas Brisbane Planetarium, Mt Coot-tha', '2025-02-16T14:00:00+10:00', '2025-02-16T14:45:00+10:00', 'Sunday, 16 February 2025, 2 - 2:45pm', 'This dazzling space show launches visitors through space and time to experience the life and death of the stars in our night sky, including our own nurturing Sun. Tour familiar stellar formations, explore new celestial mysteries, and discover the fascinating, unfolding story that connects us all to the stars. Those who come along for the journey may never see the night sky in the same way again. Narrated by Whoopi Goldberg, Session concludes with a virtual tour of the Brisbane night sky.

Journey to the Stars was developed by the American Museum of Natural History, New York in collaboration with the California Academy of Sciences, San Francisco; GOTO INC, Tokyo, Japan; Papalote • Museo del Niño, Mexico City, Mexico; and Smithsonian National Air and Space Museum, Washington, D.C. 
Journey to the Stars was created by the American Museum of Natural History, with the major support and partnership of NASA, Science Mission Directorate, Heliophysics Division.', 'Brisbane City Council', 'Family events', NULL, NULL, 'Adult $17, Child (3-14 yrs) $10, Concession $12', 'https://www.trumba.com/i/DgB8v-YDgb8EUUsAZBqd-hZQ.jpg', 'Suitable for ages 8+', '<a href="https://bcc.ungerboeck.com/prod/emc00/register.aspx?aat=716932366e7a4b3130346e7450695571626f344b506873547878464273724e6558464839525656595563413d" target="_blank">CLICK HERE TO BOOK YOUR TICKETS ONLINE</a>

For booking and venue enquiries please phone 07 3403 8888 or email <a href="mailto:bop@brisbane.qld.gov.au" target="_blank">bop@brisbane.qld.gov.au</a>.
To make a Companion Card booking please phone 3403 2578 10am-4pm Tuesday to Sunday.', NULL, NULL, 'Sir Thomas Brisbane Planetarium, Mt Coot-tha', 'Sir Thomas Brisbane Planetarium, 152 Mt Coot-tha Road, Mt Coot-tha', 'General Council venue,Library', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '180400147');
INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, venue, venueaddress, venuetype, maximumparticipantcapacity, activitytype, requirements, meetingpoint, suburb, ward, image, libraryeventtypes, locationifvenueunavailable, eventtype, waterwayaccessfacilities, waterwayaccessinformation, status, externaleventid) VALUES ('Singapore Symphony Orchestra', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d179065563', 'Queensland Performing Arts Centre (QPAC), South Brisbane', '2025-02-16T15:00:00+10:00', '2025-02-16T17:00:00+10:00', 'Sunday, 16 February 2025, 3 - 5pm', 'BrisAsia Festival 2025 and QPAC present the Singapore Symphony Orchestra in an afternoon of Romantic Masterpieces: Tchaikovsky, Brahms and Koh
   Experience a captivating afternoon of Romantic masterpieces as the Singapore Symphony Orchestra, conducted by visionary Music Director Hans Graf, makes its highly anticipated debut at BrisAsia Festival 2025 as part of its inaugural Australian tour. Held in QPAC''s prestigious Concert Hall, this spectacular program will feature Romantic favourites, young international violin sensation Chloe Chua and cellist Ng Pei-Sian.

Adding to the magic is Luciola singapura, a mesmerising new work by award-winning Singaporean composer Koh Cheng Jin. Inspired by the discovery of a new species of firefly in Singapore’s mysterious Nee Soon Forest, the piece brings the firefly’s golden glow to life through the ethereal sounds of the Yang Qin (Chinese dulcimer).

From the brilliance of Romantic classics to the shimmering beauty of Luciola singapura, this concert promises an evocative journey of sound and storytelling. Don’t miss this breathtaking musical experience at BrisAsia Festival 2025.', 'Brisbane City Council', 'Creative,Culture,Featured,Festivals,Music,Performing arts', 'BrisAsia 2025', 'Music', '$69 - $146', 'https://www.trumba.com/i/DgDEwvFDwN4E-dHuod6tncQI.jpg', 'Suitable for all ages.', 'Bookings required. To book, visit the <a href="https://bit.ly/3VB1kMu" target="_blank">QPAC website.</a>', TRUE, 'Young adults,Adults (30+),Seniors', 'Queensland Performing Arts Centre (QPAC), South Brisbane', 'Queensland Performing Arts Centre, Cnr Melbourne and Grey Street, South Brisbane', 'Non-Council venue', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '179065563');
