INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, venue, venueaddress, venuetype, maximumparticipantcapacity, activitytype, requirements, meetingpoint, suburb, ward, image, libraryeventtypes, locationifvenueunavailable, eventtype, waterwayaccessfacilities, waterwayaccessinformation, status, externaleventid) VALUES ('Passport to the Universe', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d180400389', 'Sir Thomas Brisbane Planetarium, Mt Coot-tha', '2025-02-16T15:00:00+10:00', '2025-02-16T15:45:00+10:00', 'Sunday, 16 February 2025, 3 - 3:45pm', 'Get your passport for a thrilling journey through the Solar System, beneath the rings of Saturn, into the heart of the Orion Nebula, out of the Milky Way Galaxy and to the edge of the observable universe, returning home via a black hole. Narrated by Tom Hanks.

Session concludes with a virtual tour of the Brisbane night sky.

Passport to the Universe was developed by the American Museum of Natural History, New York in collaboration with the National Aeronautics and Space Administration (NASA).
Major support for new version provided by the California Academy of Sciences, San Francisco.', 'Brisbane City Council', 'Family events', NULL, NULL, 'Adult $17, Child (3-14 yrs) $10, Concession $12', 'https://www.trumba.com/i/DgA9wToSBEymI-YpwU-TsRm-.jpg', 'Suitable for ages 8+', '<a href="https://bcc.ungerboeck.com/prod/emc00/register.aspx?aat=68627969447a535244764854326d325456325238697333416c532b4f4475594e643566794f794b463648413d" target="_blank"><strong>CLICK HERE TO BOOK YOUR TICKETS ONLINE</strong></a>

For booking and venue enquiries please phone 07 3403 8888 or email <a href="mailto:bop@brisbane.qld.gov.au" target="_blank">bop@brisbane.qld.gov.au</a>.
To make a Companion Card booking please phone 3403 2578 10am-4pm Tuesday to Sunday.', TRUE, NULL, 'Sir Thomas Brisbane Planetarium, Mt Coot-tha', 'Sir Thomas Brisbane Planetarium, 152 Mt Coot-tha Road, Mt Coot-tha', 'General Council venue,Library', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '180400389');
INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, venue, venueaddress, venuetype, maximumparticipantcapacity, activitytype, requirements, meetingpoint, suburb, ward, image, libraryeventtypes, locationifvenueunavailable, eventtype, waterwayaccessfacilities, waterwayaccessinformation, status, externaleventid) VALUES ('The Prodigy', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d177127134', 'Riverstage, Brisbane City', '2025-02-16T17:30:00+10:00', '2025-02-16T22:00:00+10:00', 'Sunday, 16 February 2025, 5:30 - 10pm', 'Pioneers of the electronic music scene, The Prodigy, have announced their return to Australia in February 2025.

Presented by Astral People, Handsome Tours & Double J, they will be playing three shows at Sydney’s Hordern Pavilion, Brisbane’s Riverstage, and Melbourne’s Rod Laver Arena.

Returning five years after the tragic passing of the group’s vocalist Keith Flint, just weeks after they toured the country, the group comes armed with seven seminal albums, and a reputation as one of the world’s most visceral and incendiary live bands. Bringing together raves and metalheads to honour both their past and their present.

The “Godfathers of Rave” aka Liam Howlett, Keith Flint, and Maxim have solidified their status as legends in the music industry with a career spanning over three decades. The Prodigy are renowned for pioneering the big beat genre, blending elements of rave, techno, and industrial music. The group, initially featuring vocalist Keith Flint and MC Maxim, gained international acclaim with their debut album, Experience (1992). Their breakthrough came with the album Music for the Jilted Generation (1994), which showcased their innovative sound and rebellious spirit. The Prodigy''s third album, The Fat of the Land (1997), solidified their status as electronic music legends, featuring hits like ‘Firestarter’ and ‘Breathe’, and topping charts worldwide.

Note: This event will include the use of strobe lights and/or lasers.', 'Brisbane City Council', 'Featured,Music', NULL, 'Music', 'Priced ticketed event', 'https://www.trumba.com/i/DgBnpkEz34x8jbBoRF9DksNY.jpg', 'Suitable for adults', 'Tickets can be purchased via <a href="https://www.ticketmaster.com.au/the-prodigy-brisbane-16-02-2025/event/130060FDC7C159F3" target="_blank">Ticketmaster</a>

Pre-sale tickets for The Prodigy will be available from Tuesday 27 Aug at 11am (local), with the general on-sale on Friday 30 August at 11am (local).', TRUE, 'Young adults,Adults (30+),Seniors', 'Riverstage, Brisbane City', 'Riverstage, Gardens Point Road, Brisbane City', 'General Council venue', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '177127134');
